(21, 'Pre-work', '2016-07-11 22:17:43', '2016-07-13 15:43:45', 'prework', 1, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n  \r\n  .page-container ul {\r\n  	font-size: 24px;\r\n  	color: #606060;\r\n  }\r\n  \r\n  .btn-course {\r\n  	background-color: #62D1B7;\r\n  	border: 1px solid #62D1B7;\r\n  }\r\n  \r\n  .page-container {\r\n     margin-top: 60px;\r\n  }\r\n  \r\n  .page-container h1 {\r\n  	font-size: 42px;\r\n    margin: 20px 0px 20px 0px;\r\n  }\r\n  \r\n</style>\r\n<div class="container-fluid page-container" style="border-top: 1px solid white;">\r\n  <div class="text-center">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/prework.jpg" height="200px"/>\r\n    <h2>Internet 101</h2>\r\n    <p class="line">Hablemos sobre los orígenes del internet, la diferencia entre internet y www<br>\r\nQué es un browser, server y cómo interactúan entre ellos</p>\r\n    <ul>\r\n      <li><a href="https://www.youtube.com/watch?v=BWb6ri3ePew" target="_blank" style="text-decoration: underline;">Mira el video sobre la historia del Internet</a></li>     \r\n    </ul>\r\n     <br>\r\n    <h2>Frontend y Backend</h2>\r\n    <p class="line">Hablamos sobre los diferentes roles que un desarrollador <br>puede tomar en un equipo de desarrollo multifuncional</p>\r\n    <ul>\r\n      <li><a href="https://www.youtube.com/watch?v=ge4h5uJN6KI" target="_blank" style="text-decoration: underline;">Mira el video sobre las etapas y roles del desarrollo web</a></li>     \r\n      <li><a href="https://www.youtube.com/watch?v=heKnQG2ATqg" target="_blank" style="text-decoration: underline;">Mira el video extra sobre las bases para el desarrollo web moderno</a></li>\r\n    </ul>       \r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, 45, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 3, '', '', 0, NULL, NULL, NULL),
(22, 'Conociendo HTML', '2016-07-12 14:08:16', '2016-08-09 21:08:39', 'exercise', 6, NULL, '', NULL, NULL, NULL, NULL, 40, NULL, 0, NULL, 0, 0, '', 'conociendo-html.zip', 'application/zip', 144012, '2016-08-09 21:08:39', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada sprint1\r\n 3. Dentro de la carpeta sprint1, crea otra carpeta llamada conociendo-html, esta será la carpeta en la que trabajarás para este ejercicio.\r\n 4. Descarga el .zip que se encuentra en la sección de Materiales al final de la página. extráelos y añade los archivos a la carpeta conociendo-html.\r\n 5. Abre el file index.html y realiza las siguientes modificaciones.\r\n\r\nEl objetivo de este ejercicio es crear una página web que se vea cómo la siguiente imagen:\r\n\r\n![Conociendo html][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/conociendo-html.png', 'https://www.youtube.com/embed/5E6BvVGRqOw?list=PL9KfKs4mHJ2lMpTqD_xSlR0cO2bsmIeOy', NULL, NULL, NULL, NULL, 0, 0, 0, '', 3, '', '', 1, NULL, NULL, NULL),
(23, 'Comandos de la terminal en GitBash', '2016-07-12 17:10:15', '2016-07-13 20:59:43', 'material', 3, NULL, '<style>\r\n  \r\n  .terminal-basico {\r\n	font-size: 1.3em;\r\n    text-align: left;\r\n    padding: 0px 21px;\r\n  }\r\n  \r\n  .terminal-basico h1 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  .terminal-basico p{\r\n  	text-align:left;\r\n  }\r\n  \r\n  .terminal-basico ul {\r\n    padding: 0 10px;\r\n  	margin-left: 20px;\r\n    list-style: disc;\r\n    text-align:left;\r\n   	text-indent: 1em;\r\n  }\r\n  \r\n  .terminal-basico ul li {\r\n    list-style: disc;\r\n  }\r\n  \r\n  .terminal-basico img {\r\n	max-width: 100%;\r\n    display:block;\r\n    margin: 20px auto;\r\n  }\r\n  \r\n</style>\r\n<div class="terminal-basico center">\r\n  <br>\r\n  <h1>Introducción</h1>\r\n  <p>La terminal es un programa de computadora cuya interfaz sirve para darle instrucciones a la computadora. Así como nosotros utilizamos a los lenguajes de programación para la creación y mantenimiento de un programa a través de instrucciones ( desde el código que escribimos ), el mismo concepto se aplica para nuestras computadoras. La diferencia es que en vez de usar un lenguaje de programación ( javascript, ruby, python, etc ) se nos brinda un grupo de comandos que van desde navegar por nuestras carpetas hasta enviar emails o iniciar servidores.</p>\r\n  <p>Git bash es un programa de computadora que emula a la terminal de un sistema operativo Linux, y definitivamente es una mejora radical sobre la terminal original de windows. Para poder usar git bash vamos a tener que aprender algunos comandos básicos para poder navegar entre las carpetas y algunos comandos git que nos permitirán luego interactuar con nuestro repositorio de datos.\r\n  </p>\r\n  <br><br>\r\n  <h1>Lista de comandos</h1>\r\n  <br>\r\n  <h2>Comando: pwd</h2>\r\n  <p>Este comando es el diminutivo de la frase "path within directory" ( ruta del directorio en español ). Funciona para que podamos saber en qué ruta nos encontramos actualmente y de esta manera seamos capaces de navegar por nuestra computadora desde la terminal con el comando cd que lo vamos a ver más adelante.</p>\r\n  <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/Posts/terminal/cdcomando.gif"/>\r\n  <br><br>\r\n  <h2>Comando: ls</h2>\r\n  <p>Dentro de la interfaz de git bash tipear el comando "ls" y presionar el botón Enter como en el gif de abajo. </p>\r\n  <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/Posts/terminal/ls.gif"/>\r\n  <p>Como puedes observar han aparecido una lista de items, estos son las carpetas y archivos que se encuentran en el directorio en que te encuentras actualmente. También podemos correr ls -all para tener mayores detalles sobre los archivos y carpetas que están en nuestro directorio, a diferencia del comando pwd que sólo te muestra la ruta en la que se encuentra tu directorio en que estás.\r\n  </p>\r\n  <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/Posts/terminal/ls-all.gif"/>\r\n  <h2>Comando: cd</h2>\r\n  <p>El comando cd es el acrónimo de "change directory" ( cambiar de directorio en español ) y nos sirve para navegar por nuestra computadora desde la terminal. En el ejemplo de abajo, utilizo el comando pwd para mostrar la ruta actual y uso cd para ingresar a una carpeta y cd .. para salir de esa carpeta</p>\r\n  <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/Posts/terminal/ls-all.gif"/>\r\n  <h2>Comando: mkdir</h2>\r\n  <p>El comando mkdir, cuyo significado viene de la frase "make directory" ( haz un directorio es español ), sirve para crear directorios o carpetas desde la terminal. Es el equivalente al proceso de hacer click derecho + nuevo + carpeta. Observa el ejemplo de abajo.\r\n  </p>\r\n  <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/Posts/terminal/mkdir.gif"/>\r\n  <h2>Comando: touch</h2>\r\n  <p>El comando touch nos sirve para modificar archivos y crear nuevos archivos vacíos en caso de que se escribiera el comando sin ninguna otra opción. Ver el ejemplo de abajo\r\n  </p>\r\n  <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/Posts/terminal/touch.gif"/>\r\n  <p>Con el conocimiento básico de estos comandos, podrás continuar  con el manejo de los comandos de Git.\r\n  </p>\r\n</div>', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 3, 'blog', '', 1, NULL, NULL, NULL),
