(25, 'What''s next?', '2016-07-13 01:49:38', '2016-07-13 01:52:39', 'material', 5, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n  \r\n  ul {\r\n  	font-size: 20px;\r\n  }\r\n  \r\n  .btn-course {\r\n  	background-color: #62D1B7;\r\n  	border: 1px solid #62D1B7;\r\n  }\r\n  \r\n  .welcome-page-container {\r\n     margin-top: 60px;\r\n  }\r\n  \r\n  .welcome-page-container h1 {\r\n  	font-size: 42px;\r\n    margin: 20px 0px 20px 0px;\r\n  }\r\n  \r\n  .welcome-page-container p {\r\n  	margin: 23px 0px 30px 0px;\r\n  }\r\n  \r\n</style>\r\n<div class="container-fluid" style="border-top: 1px solid white;">\r\n  <div class="text-center welcome-page-container">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/whats-next2.jpg"/>\r\n    <p class="line">Si quieres conocer más sobre HTML y los SCV <br> puedes ver los siguientes links:</p>\r\n    <ul>\r\n      <li><a href="https://platzi.com/blog/git-control-versiones/" target="_blank">Importancia de un Sistema de Control de versiones</a></li>\r\n      <li>Documentación de HTML (<a href="https://www.w3.org/TR/html5/" target="_blank">W3C</a> / <a href="https://developer.mozilla.org/es/docs/Web/Guide/HTML" target="_blank">Mozilla</a> / <a href="http://www.w3schools.com" target="_blank">W3S</a>)</li> \r\n      <li><a href="https://www.youtube.com/watch?v=6sEjltUCk14" target="_blank">¿Qué carrera son rentables en el 2016?</a></li>\r\n    </ul>\r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 3, 'blog', '', 1, NULL, NULL, NULL),
(26, 'Manual de referencia: Git básico', '2016-07-13 02:44:11', '2016-07-13 18:43:30', 'material', 3, NULL, '<style>\r\n  \r\n  .git-basico {\r\n  	text-align: left;\r\n  }\r\n  \r\n  .git-basico p {\r\n  	margin: 0 0 20px;\r\n    font-size: 1.3em;\r\n  }\r\n  \r\n  .git-basico img {\r\n  	margin: 20px 0px;\r\n  }\r\n  \r\n  .git-basico h1 {\r\n  	margin-bottom: 20px;\r\n  }\r\n</style>\r\n<div class="container-fluid git-basico p-21">\r\n\r\n<h1>Introducción</h1>\r\n<p>Ahora que ya conocemos cómo funciona la línea de comandos y lo que es una terminal, empecemos a mirar el flujo de trabajo con los comandos que vienen con git.</p>\r\n\r\n<p>Git es un sistema de control de versiones que nació con la finalidad de resolver las deficiencias de SVN (un sistema de control versiones más antiguo). Los sistema de control de versiones tienen como finalidad guardar todas las versiones de un archivo (en este caso de nuestro código) de tal manera que no se pierda ningún cambio que se haga al código.</p>\r\n\r\n<p>Muchos equipos que desarrollan software utilizan los sistema de versiones de controles para mejorar el flujo de trabajo pues estos permite centralizar todo el código que desarrolla el equipo en un sólo lugar y hace que la colaboración sea mucho más sencilla de realizar. </p>\r\n  \r\n<h2>¿Qué es un Repositorio?</h2> \r\n\r\n<p>Pensemos que un repositorio es un lugar donde ponemos nuestro código y los cambios que vayamos haciendo mientras desarrollamos nuestro proyecto. De esta manera, si tenemos algún error que querramos corregir o querramos hacer algún cambio desde un punto específico del desarrollo tenemos un lugar donde se encuentra todo nuestro historial.</p>\r\n  \r\n  <p>Existen dos tipos de repositorios: </p>\r\n  \r\n  <p><strong>Local:</strong> Repositorio que se crea en nuestra computadora y no necesitamos una conexión a internet para acceder a él y donde podemos hacer todos los cambios a nuestro proyecto</p>\r\n  \r\n  <p><strong>Alojado ( hosting ):</strong> Repositorio en la nube que tiene una copia de tus archivos locales. El repositorio remoto con el local deben estar vinculados (<kbd>git remote add origin ....</kbd>) para poder replicar los cambios realizados en el repositorio local en el repositorio remoto. Los servicios más conocidos para tener alojado tu código son Bitbucket y Github.</p>\r\n  \r\n  <p>Te recomiendo que ya debes de tener una cuenta en alguno de ellos antes de seguir leyendo este post y si no lo tienes, crearte una.</p>\r\n\r\n<h2>Configuración previa a usar Git</h2>\r\n  \r\n<p>Ahora que ya tenemos Git instalado, debemos identificarnos. Para hacer esto, debes correr los siguientes comandos:</p>\r\n\r\n<kbd>git config --global user.name tu-nombre</kbd><br>\r\n<kbd>git config --global user.email tu-email</kbd><br><br>\r\n  \r\n<p>Este comando está grabando nuestra información personal en la configuración global de git, lo que permite que otros comandos utilicen esta información global para identificar quien está realizando el comando.</p>\r\n<p>No te preocupes, sólo necesitas hacer esto una sóla vez y te servirá para no darte problemas al momento de subir tu proyecto a tu repositorio de alojamiento. </p>\r\n  \r\n<div class="example-gif"><img src="http://i.imgur.com/oH2DiBX.gif" alt="git-config-gif"></div> <br/>\r\n\r\n<p>Para poder manejar Git correctamente, tenemos que conocer lo que es un repositorio.</p>\r\n  \r\n<h2>Creando un repositorio local</h2>  \r\n  \r\n  <p>En nuestra terminal, asegurémonos de estar dentro de nuestra carpeta del proyecto con el que vamos a usar git y corramos el comando: <kbd>git init</kbd>, tal y como lo ven en el ejemplo de abajo</p>\r\n  \r\n   <div class="example-gif"><img src="http://i.imgur.com/FIOuG4D.gif" alt="git-init-gif"></div> <br/><br/>\r\n  \r\n  <p>Luego de correr este comando vemos que aparece un mensaje en inglés que nos dice que se ha creado con satisfacción un repositorio en nuestro proyecto.</p>\r\n  \r\n  <p>Una vez que tenemos nuestro repositorio local creado vamos a ver ver los comandos básicos que son parte del flujo de trabajo con Git.</p>\r\n<h2>Agregando archivos a mi repositorio local</h2>\r\n	<br>\r\n  <p><kbd>git add .</kbd></p>\r\n  <p>Este comando pondrá en la mira de git a nuestros archivos del proyecto. Podríamos utilizar <kbd>git add .</kbd> siendo el punto la forma de decir que queremos agregar todos los archivos o podríamos correr <kbd>git add nombre-del-archivo</kbd> si quisieramos agregar sólo una parte de lo que está en nuestra carpeta del proyecto. </p>\r\n<p>Veamos estas dos maneras en el ejemplo</p>\r\n\r\n<div class="example-gif"><img src="http://i.imgur.com/O4k9bR9.gif" alt="git-init-gif"></div> <br/><br/>\r\n  \r\n  <h2>¿Cómo obtener información de mi repositorio local?</h2>\r\n     <br><p><kbd>git status</kbd></p>\r\n  <p>Este comando contiene la información sobre el estado de nuestros archivos y directorios que vayamos a tener en nuestro git. Esa información incluye decirnos si hemos hecho algún cambio en algún archivo o si hay algún archivo que no está dentro del nuestro flujo de versionamiento. Veamos como se ve en nuestro ejemplo</p>\r\n  \r\n  <div class="example-gif"><img src="http://i.imgur.com/w0FNEn6.gif" alt="git-status-gif"></div> <br/><br/>\r\n  \r\n  <p>Como vemos en nuestro ejemplo, hemos corrido el comando y vemos que todos nuestros archivos están rojos, esto quiere decir que git está reconociendo que hay archivos dentro de la carpeta del proyecto pero que no son parte árbol de versionamiento (?) para agregarlos al repositorio de git veamos el siguiente comando:\r\n</p>\r\n    \r\n  <h2>Comiteando los archivos locales</h2>\r\n  <br>\r\n  <p><kbd>git commit -m "escribe aquí una descripción de tu primer commit"</kbd></p>\r\n  <p>Luego que ya tenemos los archivos que queremos en la mira de git, nos toca grabar los cambios que hemos hecho hasta ahora, que en este caso vendría a ser el agregar nuestros archivos al árbol. La forma usual de correr este comando es <kbd>git commit -m "escribe aquí una descripción de tu primer commit"</kbd> donde -m es la opción que te permite escribir un mensaje.</p><br>\r\n  <p>Mira el ejemplo</p>\r\n  \r\n  <div class="example-gif"><img src="http://i.imgur.com/u52vOTr.gif" alt="git-init-gif"></div> <br/><br/>\r\n    \r\n    <p>Puedes específicar todo lo que desees en tus mensajes de commits.</p>\r\n    \r\n  \r\n</div>\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 4, 'blog', '', 1, NULL, NULL, NULL),
(27, 'Manual de Referencia: Github', '2016-07-13 03:01:10', '2016-07-13 18:44:05', 'material', 4, NULL, '<style>\r\n  \r\n  .git-basico {\r\n  	text-align: left;\r\n  }\r\n  \r\n  .git-basico p{\r\n   margin: 0 0 20px;\r\n   text-align: left;\r\n   font-size: 1.3em;\r\n  }\r\n  \r\n  .git-basico img{\r\n  	max-width: 100%;\r\n  }\r\n  \r\n  .git-basico ul {\r\n  	display:block;\r\n  	width: 80%;\r\n    margin: auto;\r\n  	text-align: left;\r\n  }\r\n</style>\r\n<div class="container-fluid git-basico">\r\n  <h1>Crear un Respositorio en Github</h1>\r\n  \r\n  <p>Como les conté en el post anterior, luego de crear nuestro primer commit, el siguiente paso es crear un repositorio nuevo en Github. Recordar que previamente debemos crearnos una cuenta en <a href="http://www.github.com" target="_blank">http://www.github.com </a>.</p>\r\n\r\n<p>Una vez que creaste tu repositorio de alojamiento, dependiendo de en que servicio tengas tu cuenta, te saldrá una imagen como esta</p>\r\n  \r\n  <div class="example-img"><img src="http://i.imgur.com/sEExHgn.jpg"/></div> <br/><br/>\r\n\r\n<p>En mi caso, yo tengo una cuenta en Github así que ahí creé mi repositorio. Como vemos, hay una serie de instrucciones que hay que seguir. Como yo ya llegué hasta la parte donde hice mi primer commit lo siguiente que me toca es correr el comando <kbd>git remote add origin url-del-repositorio</kbd> y consecutivamente <kbd>git push origin master</kbd>. Veamos el ejemplo.</p>\r\n    \r\n     <div class="example-img"><img src="http://i.imgur.com/JJf1wKi.gif"/></div> <br/><br/>\r\n       \r\n       <p>Como vemos en el ejemplo, con el primer comando hemos hecho la conexión entre mi repositorio local y mi repositorio que cree en Github y con el siguiente he hecho la subida de mis archivos y sus commits. El primer comando sólo se debe de correr una vez ya que sólo es para establecer la conexión de la que hablé al comienzo y a partir de aquí se realizará el mismo flujo cada vez que creamos conveniente.</p>\r\n       \r\n       <h3>Flujo</h3>\r\n       \r\n       <ul>\r\n         <li><kbd>git status</kbd></li>\r\n         <li><kbd>git add</kbd></li>\r\n         <li><kbd>git commit</kbd></li>\r\n         <li><kbd>git push origin master</kbd></li>\r\n       </ul>\r\n	\r\n       <h3>Sigamos con mi ejemplo</h3>\r\n\r\n      \r\n       <div class="example-img"><img src="http://i.imgur.com/XNJ0nKd.gif"></div> <br/><br/>\r\n\r\n         </div>', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 4, 'blog', '', 1, NULL, NULL, NULL),
(28, 'What''s next? ', '2016-07-13 03:17:17', '2016-07-18 20:08:07', 'material', 5, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n  \r\n  .btn-course {\r\n  	background-color: #62D1B7;\r\n  	border: 1px solid #62D1B7;\r\n  }\r\n  \r\n  .welcome-page-container {\r\n     margin-top: 60px;\r\n  }\r\n  \r\n  .welcome-page-container h1 {\r\n  	font-size: 42px;\r\n    margin: 20px 0px 20px 0px;\r\n  }\r\n  \r\n  .welcome-page-container p {\r\n  	margin: 23px 0px 30px 0px;\r\n  }\r\n  \r\n  .link {\r\n  	text-decoration: underline;\r\n  }\r\n  \r\n</style>\r\n<div class="container-fluid" style="border-top: 1px solid white;">\r\n  <div class="text-center welcome-page-container">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/whats-next2.jpg"/>\r\n    <p class="line">Si quieres conocer otros comandos de git que usarás en el día a día.</p>\r\n      <ul>\r\n        <li><a href="http://rogerdudler.github.io/git-guide/index.es.html" target="_blank">Crear branch, fork, tag (Guide)</a></li>\r\n        <li><a href="https://www.codecademy.com/es/learn/learn-git" target="_blank">Repaso de Git (Code Academy)</a>\r\n        <li><a href="https://www.youtube.com/watch?v=1h9_cB9mPT8" target="_blank" >Git y github para novatos (Inglés)</a></li>  \r\n        <li><a href="https://www.youtube.com/watch?v=Qn186NyDqOk" target="_blank">Curso de git y github en código facilito</a></li> \r\n      <li><a href="http://www.genbetadev.com/sistemas-de-control-de-versiones/conociendo-github-el-servicio-donde-alojar-tus-repositorios-git-como-el-nuestro" target="_blank">Blog Post: github</a></li> \r\n    </ul>\r\n\r\n\r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 4, 'blog', '', 0, NULL, NULL, NULL),
(29, 'Pre-work', '2016-07-13 04:22:02', '2016-07-14 16:39:59', 'prework', 1, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  	 width: 60%;\r\n  	 margin: 0px auto;\r\n  }\r\n  \r\n  .page-container ul {\r\n  	font-size: 24px;\r\n  	color: #606060;\r\n  }\r\n  \r\n  .btn-course {\r\n  	background-color: #62D1B7;\r\n  	border: 1px solid #62D1B7;\r\n  }\r\n  \r\n  .page-container {\r\n     margin-top: 60px;\r\n  }\r\n  \r\n  .page-container h1 {\r\n  	font-size: 42px;\r\n    margin: 20px 0px 20px 0px;\r\n  }\r\n  \r\n</style>\r\n<div class="">\r\n  <div class="text-center">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/prework.jpg" height="200px"/>\r\n    <h2>Git y Github</h2>\r\n    <p class="line">Hablemos sobre git y github, aprendamos los conceptos detrás del controlador de versiones más usado en la actualidad..</p>\r\n    <ul>\r\n      <li><a href="http://rogerdudler.github.io/git-guide/index.es.html" target="_blank" style="text-decoration: underline;">Git - La guía sencilla</a></li>  \r\n      <li><a href="http://marklodato.github.io/visual-git-guide/index-es.html" target="_blank" style="text-decoration: underline;">Una referencia visual de Git</a></li> \r\n      <li><a href="https://try.github.io/levels/1/challenges/1" target="_blank" style="text-decoration: underline;">Try Git</a></li> \r\n    </ul>      \r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, 45, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 4, '', '', 0, NULL, NULL, NULL),
(30, 'Pre Work: Ejercicio Viendo Cajas', '2016-07-13 04:31:13', '2016-09-12 22:02:57', 'prework', 1, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n  \r\n  .page-container ul {\r\n  	font-size: 24px;\r\n  	color: #606060;\r\n  }\r\n  \r\n  .btn-course {\r\n  	background-color: #62D1B7;\r\n  	border: 1px solid #62D1B7;\r\n  }\r\n  \r\n  .page-container {\r\n     margin-top: 60px;\r\n  }\r\n  \r\n  .welcome-page-container h1 {\r\n  	font-size: 42px;\r\n    margin: 20px 0px 20px 0px;\r\n  }\r\n  \r\n  .welcome-page-container p {\r\n  	margin: 23px 0px 30px 0px;\r\n  }\r\n  \r\n</style>\r\n<div class="container-fluid" style="border-top: 1px solid white;">\r\n  <div class="text-center">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/prework.jpg" height="200px"/>\r\n    <h2>Ejercicio: Viendo Cajas</h2>\r\n    <p class="line">Desarrollar el siguiente ejercicio y subirlo a github. El ejercicio vale 70 puntos</p>\r\n    <ul>\r\n      <li><a href="http://capitan-dev.laboratoria.la/tracks/1/courses/4/units/2/lessons/5/pages/31" target="_blank" style="text-decoration: underline;">Viendo Cajas</a></li>     \r\n    </ul>\r\n     \r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, 0, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 5, '', '', 0, '', NULL, NULL),
(31, 'Ejercicio: Viendo Cajas', '2016-07-13 04:32:54', '2016-09-12 22:03:28', 'exercise', 3, NULL, '', NULL, NULL, NULL, NULL, 60, NULL, 0, NULL, 0, 0, '', 'viendo-cajas.zip', 'application/zip', 13691, '2016-07-13 04:37:06', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (Si es que ya la has creado no es necesario repetir el proceso).\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Viendo cajas\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/) da (Viendo Cajas).\r\n 5. Dentro del ZIP encontrarán una imagen y un archivo index.html \r\n\r\nCon los archivos proporcionados crear la estructura HTML necesaria para que se vea igual que en la imagen.\r\n\r\n![enter image description here][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/viendo-cajas-2.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 5, '', '', 1, '', NULL, NULL),
(32, 'Ejercicio: Lenguajes de la web', '2016-07-13 04:44:46', '2016-09-12 22:04:14', 'exercise', 4, NULL, '', NULL, NULL, NULL, NULL, 40, NULL, 0, NULL, 0, 0, '', 'lenguajes-web-1.zip', 'application/zip', 42669, '2016-07-13 04:44:46', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (Si es que ya la creo no es necesario repetir el proceso).\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Lenguajes de la Web\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guardalo en la carpeta creada (Lenguajes de la web).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. Dentro del ZIP encontrarán una carpeta de img, un .ico y un file index.html\r\n\r\n**Parte 1**\r\n\r\nCon los archivos proporcionados crear la estructura HTML necesaria para que se vea igual que en la imagen\r\n\r\n**Parte 2**\r\n\r\nUna vez que la estructura HTML está lista realice los siguientes cambios:\r\n\r\nPara el título cambie los siguientes elementos:\r\n\r\n - color: red \r\n - peso de la letra: 500\r\n -  letra: Arial\r\n - tamaño de letra: 20px\r\n\r\nPara cada lenguaje:\r\n\r\n - Que la imagen tenga un borde (color: blue, de 1px y sólido)\r\n - Que el párrafo sea (color: yellow, tamaño de letra 14px)\r\n\r\nPara el h2 sea:\r\n\r\n - color: black\r\n - tamaño de letra 16px\r\n\r\n**Parte 3**\r\n\r\nTraslada todos los estilos de la página del “Lenguajes de la web” al `<head>`\r\n\r\n**Parte 4**\r\n\r\nTraslada todos los estilos de la página del “Lenguajes de la web” a un nuevo archivo css (main.css) y conecta el HTML con el CSS\r\n\r\n![enter image description here][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/lenguajes-web-2.png', '', 'lenguajes-web.zip', 'application/zip', 175487, '2016-07-13 04:51:16', 0, 0, 0, '', 5, '', '', 1, '', NULL, NULL),
(33, 'Etiquetas : Texto', '2016-07-13 04:56:24', '2016-07-21 16:34:57', 'material', 6, NULL, '<style>\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n</style>\r\n<h1 class="page-title">Etiquetas</h1>\r\n<div class="blog p-21">\r\n<p>Cuando creamos sitios webs utilizamos etiquetas HTML para los contenidos. Estás etiquetas le dan al contenido un significado y le permite al navegador el poderle mostrar a los usuarios la estructura apropiada del sitio.</p>\r\n \r\n<p>Para la creación de un sitio web es necesario conocer los dos tipos de estructura al que pertenecen:</p>\r\n  <ul>\r\n    <li><strong>Estructura de etiquetas:</strong> Los elementos que utilizamos para para describir el contenido</li>\r\n    <li><strong>Estructura Semántica:</strong> Es la que provee información adicional.</li>\r\n  </ul> \r\n  \r\n<h2>Etiquetas de texto</h2>\r\n  <h3>Encabezados</h3>\r\n  <p>Los navegadores despliegan los contenidos de encabezados en diferentes tamaños. Para el caso de las etiquetas de HTML, la etiqueta <code>&lt;h1&gt;&lt;/h1&gt;</code>, es por defecto, el más grande mientras que los contenidos que pertenecen a las etiquetas <code>&lt;h6&gt;&lt;/h6&gt;</code>, son los más pequeños.</p>\r\n  <p>Los tamaños exactos en los que el navegador despliega los encabezado varía según que navegador el usuario esté utilizando. Sin embargo, se puede crear tamaños globales utilizando CSS, que ya veremos más adelante.</p>\r\n  <p data-height="335" data-theme-id="dark" data-slug-hash="BzyXXg" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/BzyXXg/">BzyXXg</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>Parrafos</h3>\r\n  Para crear un párrafo sólo es necesario envolver las palabras que son parte del párrafo en etiquetas <code>&lt;p&gt;&lt;/p&gt;</code>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="ezNWBW" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/ezNWBW/">ezNWBW</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>Negrita e Itálica</h3>\r\n  <p>Al envolver palabras con las etiquetas <code>&lt;b&gt;&lt;/b&gt</code> podemos hacer que los caracteres se vean en negrita. Este elemento también representa una sección de la estructura que puede ser distinta visualmente. Sin embargo, esta etiqueta no da ningún tipo de significado semántico para el navegador. Otra opción mucho más semántica es la etiqueta <a href="#s-em">Strong</a></p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="oLXWBM" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/oLXWBM/">Negrita e Itálica</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n\r\n<p>Al envolver palabras con las etiquetas <code>&lt;i&gt;&lt;/i&gt</code> podemos hacer que los caracteres se vean en cursiva (itálica). Este elemento también representa una sección de la estructura que puede ser distinta visualmente. Sin embargo, esta etiqueta no da ningún tipo de significado semántico para el navegador. Otra opción mucho más semántica es la etiqueta <a href="#s-em">Em</a></p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="PzqmmM" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/PzqmmM/">Itálica</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>Espacios en blanco</h3>\r\n<p>Con la finalidad de hacer un código leíble, los desarrolladores agregan espacio extra entre elementos. Cuando el navegador ve que hay dos espacios en blanco, lo interpreta como si fuera uno solo. De manera similar, si el navegador se encuentra con un salto de línea, lo trata como un espacio en blanco</p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="oLXmwM" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/oLXmwM/">White Space</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>Saltos de Línea y Líneas Horizontales</h3>\r\n  <p>Como ya hemos visto previamente, el navegador automáticamente mostrará encabezados y parráfos uno debajo del otro pero si quisiéramos hacer un salto de línea en medio de un parráfo podemos agregar un salto de línea con la etiqueta <code>&lt;br/&gt;</code></p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="zBGwmj" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/zBGwmj/">Saltos de Línea</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3 id="s-em">Strong y Enfasis</h3>\r\n  La etiqueta <code>&lt;strong&gt;&lt;/strong&gt;</code> indica que el contenido tiene una fuerte importancia. En el siguiente ejemplo podemos ver podemos ver que además de darle un significado semántico de importancia a las palabras contenidas dentro de esta etiqueta, vemos que por defecto muestra dichas palabras en negrita.\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="XKbOEz" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/XKbOEz/">XKbOEz</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <p>La etiqueta <code>&lt;em&gt;&lt;/em&gt;</code> indica el énfasis que cambia sutilmente el significado de una oración. En el siguiente ejemplo podemos ver que además de darle un significado semántico de cambio sutil a las palabras contenidas dentro de esta etiqueta, vemos que por defecto muestra dichas palabras en italica</p>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="KMpJra" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/KMpJra/">Em</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>Citas</h3>\r\n  <p>Existen dos etiquetas que son las más usadas para las citas</p>\r\n  <code>&lt;blockquote&gt;:</code>\r\n  <p>Esta etiqueta es utilizada para aquellas citas que son largas como un párrafo. Por defecto, los navegadores tienden a indentar el contenido envuelto en esta etiqueta. Sin embargo, no es recomendable utilizar este elemento sólo para crear este efecto visual.</p>\r\n  <code>&lt;q&gt;:</code>\r\n  <p>Esta etiqueta es usada para citas más ligeras que usualmente se encuentran dentro de párrafos. Sin embargo, esta etiqueta tiene algunos problemas de compatibilidad con Internet Explorer por lo que se busca usarla en el menor de los casos posibles.</p>\r\n  <code>&lt;cite&gt;:</code>\r\n  <p>Cuando se hacen referencias bibliográficas, esta etiqueta nos ayuda a indicar de donde proviene una cita</p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="aZOMbR" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/aZOMbR/"><q></a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n    <h3>Detalles del autor</h3>\r\n	<p>La etiqueta &lt;address&gt;&lt;/address&gt; funciona como un contenedor de información de contacto. Se puede agregar una dirección pero no es necesario.</p> \r\n    <p>Por defecto, los navegadores muestran el contenido dentro de la etiqueta en itálica.</p>\r\n    <h4>Ejemplo</h4>\r\n    <p data-height="265" data-theme-id="dark" data-slug-hash="LZVaeP" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/LZVaeP/">Detalles del autor</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n    <h3>Cambios en el contenido</h3>\r\n    <p>La etiqueta <code>&lt;ins&gt;&lt;/ins&gt;</code> puede ser usado para mostrar contenido que ha sido insertado en el documento, mientras que la etiqueta &lt;del&gt;&lt;/del&gt; para mostrar contenido que ha sido eliminado del documento.</p>\r\n    \r\n    <p>El contenido que se encuentre dentro de las etiquetas <code>&lt;ins&gt;&lt;/ins&gt;</code> se muestra subrayado mientras que el contenido que se encuentra dentro de las etiquetas <code>&lt;del&gt;&lt;/del&gt;</code> se muestra con un tachado</p>\r\n    <p data-height="265" data-theme-id="dark" data-slug-hash="NrqJYa" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/NrqJYa/">Cambios de contenido</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n    </div>\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 5, 'blog', '', 0, NULL, NULL, NULL),
