(39, 'Etiquetas : Listas', '2016-07-13 21:24:03', '2016-07-21 16:35:08', 'material', 7, NULL, '<style>\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n</style>\r\n</style>\r\n<div class="blog p-21">\r\n<p>HTML nos proporciona tres diferentes tipos de listas:.</p>\r\n  <ul>\r\n    <li>\r\n      <strong>Listas Ordenadas:</strong> aquellas listas donde cada item en la lista está ordenado de forma numérica. Por ejemplo, podríamos utilizar una lista de ingredientes para la receta de un postre.\r\n    </li>\r\n    <li><strong>Listas Desordenadas:</strong> aquellas listas que comienzan con viñetas, en vez de caracteres que muestran algún orden.</li>\r\n    <li><strong>Listas Definidas:</strong> aquellas listas que tienen términos para cada item</li>\r\n  </ul> \r\n  \r\n  <h3>Listas Ordenadas</h3>\r\n  <p>Estas listas son creadas con la etiqueta <code>&lt;ol&gt;&lt;/ol&gt;</code></p>\r\n  <h3>Listas Desordenadas</h3>\r\n  <p>Estas listas son creadas con la etiqueta <code>&lt;ul&gt;&lt;/ul&gt;</code></p>\r\n  \r\n  <p><strong>Nota:</strong> Tanto para las listas ordenadas y desordenadas, se utiliza la etiqueta 		<code>&lt;li&gt;&lt;/li&gt;</code> para definir los items de la lista. Por defecto, los navegadores le ponen sangría al contenido de las listas</p>\r\n  \r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="mEJogW" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/mEJogW/">Listas</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n   \r\n  <h3>Listas de Definición</h3>\r\n  <p>Las listas de definción se crean con la etiqueta <code>&lt;dl&gt;</code> y por lo general se compone de una serie de términos y definiciones. Dentro de las etiquetas <code>&lt;dl&gt;</code> usualmente se encontrarán pares de etiquetas <code>&lt;dt&gt;</code> y <code>&lt;dd&gt;</code></p>\r\n  <p>\r\n  <code>&lt;dt&gt;</code>: Esta etiqueta se utiliza para contener el termino definido. </p>\r\n  <p><code>&lt;dd&gt;</code>: Esta etiqueta se utiliza para contener la definición.</p>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="EyjJjx" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/EyjJjx/">Listas de Definición</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>Listas anidadas</h3>\r\n  <p>Es posible colocar una lista dentro de una etiqueta <code>&lt;li&gt;</code> para crear una sublista o lista anidada.</p>\r\n  <p>Los navegadores desplegan las listas anidadas de forma indentada, alejadas un poco de la lista padre así como se cambia el estilo de las viñetas.</p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="WxvWrg" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/WxvWrg/">Listas anidadas</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  \r\n</div> \r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 5, 'blog', '', 1, NULL, NULL, NULL),
(40, 'Etiquetas : Enlaces', '2016-07-13 21:25:32', '2016-07-21 16:35:16', 'material', 8, NULL, '<style>\r\n  h2,h3,h4,h5,h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n  }\r\n  .blog h1 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n\r\n<h1>Enlaces</h1>\r\n<p>Los enlaces ( links ) son una característica importante de la web ya que nos permiten mover de un sitio web a otro, permitiendo hacer real el concepto de navegación. Usualmente nos encontraremos con los siguientes tipos de enlaces</p>\r\n  <ul>\r\n    <li>Enlaces de un sitio web a otro</li>\r\n    <li>Enlaces de una página a otro en el mismo sitio web</li>\r\n    <li>Enlaces de alguna parte de una página web a otra parte de la misma página</li>\r\n    <li>Enlaces que se abren en una nueva página del navegador</li>\r\n  </ul> \r\n  \r\n  <h3>¿Cómo se escriben los enalces?</h3>\r\n  <p>Los enlaces son creados con la etiqueta <code>&lt;a&gt;</code> Los usuarios pueden hacer click en cualquier parte del texto que se encuentra dentro de estas etiquetas. Podemos especificar hacia que página queremos enlazar usando el atributo <code>href</code> </p>\r\n  \r\n  <p>Por defecto, los navegadores despliegan los links con un color azul y subrayados.</p>\r\n  \r\n  <p><code style="font-size:20px; text-align:center;">&lt;a href=&quot;http://www.google.com&quot;&gt;Google&lt;/a&gt;</code></p>\r\n  \r\n  <h3>Enlazando a otros sitios</h3>\r\n  <p>Cuando queremos enlazar hacia otro sitio web, el valor del atributo href tiene que ser la dirección completa del sitio a donde queremos ir, más conocida como una URL o ruta absolutas</p>\r\n  \r\n  <h4>URLs Absolutas</h4>\r\n  <p>El acrónimo URL significa Localizador Uniforme de Recursos ( Uniform Resource Locator ). Todo sitio web tiene su propio URL y es la ruta que uno escribe en el navegador para llegar a dicho sitio.</p>\r\n  <p>Las URLs absolutas comienzan con el nombre del dominio del sitio y seguido de la ruta a una página específica. En caso de no haber una página especificada el sitio mostrará la página de inicio.</p>\r\n  <h4>URLs Relativas</h4>\r\n  [Insertar video sobre URLs Relativas y estructura de directorios]\r\n  \r\n  <h3>Enlazando a otras páginas en el mismo sitio</h3>\r\n  <p>Cuando se enlaza a otras páginas del mismo sitio no es necesario especificar el dominio en la URL. Se puede utilizar un atajo más conocido como una URL relativa. </p>\r\n  <p>Si las páginas se encuentran en el mismo directorio, el valor del atributo solamente sería el nombre de la página</p>\r\n  \r\n  <h3>Enlaces de Email</h3>\r\n  <p>Para poder crear un enlace que abra un programa de correo electrónico y direcciona hacia un correo electrónico específico, se utiliza la etiqueta <code>&lt;a&gt;</code> con el valor del <code>href</code> de <code>mailto:</code> seguido por la dirección de correo que quisieras que se te escriba</p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="MeayGp" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/MeayGp/">Enlace a Email</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>Abrir enlaces en una nueva ventana</h3>\r\n  <p>Para el caso en que queremos que un enlace se abra en otra ventana, podemos usar el atributo <code>target</code> dentro de la etiqueta <code>&lt;a&gt;</code> seguido del valor <code>_blank</code></p>\r\n  <h3>Enlazar a una parte específica de la misma página web</h3>\r\n  <p>Al inicio de una página larga podríamos agregar una lista de contenidos que enlazan que se unen con las secciones más abajo. Or quizá deseas agregar un enlace desde una parte de la página que te lleve hacia el inicio de la misma y así evitarle el trabajo al usuario de tener que hacer scroll hasta el inicio.</p>\r\n  <p>Antes de poder crear los enlances, necesitamos identificar los puntos en la página que queremos a donde vaya nuestro enlace. Para hacer esto, necesitamos utilizar un atributo identificador <code>id</code> ( el cual podemos utitlizar en cualquier etiqueta HTML ).</p>\r\n  <h4>Ejemplo</h4>\r\n  <p>En este ejemplo, podemos ver que las etiquetas <code>h1</code> y <code>h2</code> contienen los atributos de <code>id</code> a los que pertenecen las secciones de la página.</p>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="EyVyjp" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/EyVyjp/">Enlazar a una parte específica de la misma página web</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 5, 'blog', '', 1, NULL, NULL, NULL),
(41, 'Etiquetas : Imágenes', '2016-07-13 21:27:15', '2016-07-21 16:35:24', 'material', 9, NULL, '<style>\r\n  h2,h3,h4,h5,h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n  }\r\n  .blog h1 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n\r\n<h1>Imágenes</h1>\r\n<p>Debido a que un sitio web no solamente es texto, en algún momento vamos a necesitar ingresar archivos de multimedia: imagénes, videos, etc. Para realizar esto debemos considerar los siguientes puntos:</p>\r\n  <ul>\r\n    <li>Incluir una imagen utilizando HTML</li>\r\n    <li>Escoger el formato a usar</li>\r\n    <li>Mostrar la imagen en su dimensión correcta</li>\r\n    <li>Optimizar la imagen para que su uso sea de web y ayude a que las página carguen más rápido</li>\r\n  </ul> \r\n  \r\n  <h3>Escoger imágenes para tu sitio</h3>\r\n  [insertar video sobre imágenes y como guardarlas en nuestro sitio]\r\n  \r\n  <h3>Agregando Imágenes</h3>\r\n  <p>Para empezar a agregar una imagen lo primero que necesitamos es la etiqueta <code>&lt;img&gt;</code>. Esta etiqueta se conoce como un elemento vacío, quiere decir que no tiene una etiqueta que lo cierra. Sin embargo, esta etiqueta debe de contener los siguientes atributos</p>\r\n  \r\n  <p><code>src</code>: Este atributo le dice al navegador donde puede encontrar la imagen. El valor de este atributo es usualmente una URL relativa que apunta hacia la imagen.</p>\r\n  [mostrar video o gif con ejemplo de imagen]\r\n  <p><code>alt</code>: Este atributo nos permite dar una descripción de la imagen. Esta descripción será visible en caso de que la imagen no pueda cargar. El texto que se encuentra como valor de este atributo debe de ser lo más preciso posible para que así los lectores de pantalla y los motores de búsqueda, usados por personas con discapacidad visual, puedan entenderlo.</p>\r\n  <p>En caso de que la imagen exista sólo por razones de hacer el sitio más atractivo y no tuviera ningún tipo de significado ( como una línea separadora de texto ) el atributo debe ser usado pero con el valor dejado vacío.</p>\r\n  <p><code>title</code>: Este atributo puede ser usado como otra fuente de información de la imagen.</p>\r\n  <p><code>height</code> y <code>width</code>: En algunos casos podemos apreciar estos atributos que determinan el alto y el ancho de la imagen respectivamente.</p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="VjvjOa" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/VjvjOa/">Insertar una imagen con URL Absolutas</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 5, 'blog', '', 1, NULL, NULL, NULL),
(42, 'Etiquetas : Tablas', '2016-07-14 15:42:23', '2016-07-21 16:35:36', 'material', 10, NULL, '<style>\r\n  h2,h3,h4,h5,h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n  }\r\n  .blog h1 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n\r\n<p>Una nos sirve para mostrar información en forma de una grila en donde cada bloque se conoce como una celda. Las tablas nos ayudan a desplegar información tabulada. Por ejemplo, podemos mostrar reportes financieros, programación de televisión, etc.</p>\r\n  <p>La estructura básica de una tabla consiste en las siguientes etiquetas</p>\r\n  <ul>\r\n    <li><code>&lt;table&gt;</code>: Etiqueta que crea la tabla</li>\r\n    <li><code>&lt;tr&gt;</code>: Etiqueta que crea las filas de la tabla</li>\r\n    <li><code>&lt;td&gt;</code>: Etiqueta que representa la celda de una tabla. Usualmente va dentro de la etiqueta <code>&lt;tr&gt;</code> </li>\r\n    <li><code>&lt;th&gt;</code>: Etiqueta que cumple la misma función de celda que <code>&lt;td&gt;</code> pero además sirve para que sea como celda de encabezado</li>\r\n  </ul>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="YWyGqN" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/YWyGqN/">Estructura básica de una tabla </a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  \r\n  <h3>Expandiendo las filas (columns)</h3>\r\n  <p>A veces, vamos a necesitar que las entradas de la tablas se expandan más allá de una fila.</p>\r\n  <p>El atributo <code>colspan</code> nos ayuda para realizar esto. Lo podemos colocar dentro de la etiqueta <code>th</code> o <code>td</code> y como valor el número de filas que queremos.</p>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="wWKpvP" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/wWKpvP/">Colspan</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  \r\n  <h3>Expandiendo las columnas (rows)</h3>\r\n  <p>Al igual que con las filas, a veces, vamos a necesitar que las entradas de la tablas se expandan más allá de una columna.</p>\r\n  <p>El atributo <code>rowspan</code> nos ayuda para realizar esto. Lo podemos colocar dentro de la etiqueta <code>th</code> o <code>td</code> y como valor el número de columnas que queremos.</p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="PzPEbO" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/PzPEbO/">Rowspan</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>Tablas Grandes</h3>\r\n  <p>Existen 3 elementos que nos ayudan a distinguir entre el contenido principal de una tabla con las primeras y últimas filas ( que pueden tener un contenido diferente).</p>\r\n  <p>Estas etiquetas ayudan a las personas que utilizan un lector de pantalla.</p>\r\n  <ul>\r\n    <li><code>&lt;thead&gt;</code>: Para los encabezados de la tabla</li>\r\n    <li><code>&lt;tbody&gt;</code>: Para los contenidos de la tabla</li>\r\n    <li><code>&lt;tfoot&gt;</code>: Para el contenido que pertenece al pie de la tabla</li>\r\n  </ul>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="JKYVBK" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/JKYVBK/">Tablas Grandes</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  </div>', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 5, 'blog', '', 1, NULL, NULL, NULL),
(43, 'Etiquetas : Formulario', '2016-07-14 15:43:55', '2016-07-21 16:35:44', 'material', 11, NULL, '<style>\r\n  h2,h3,h4,h5,h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n  }\r\n  .blog h1 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n\r\n<h1>Formularios</h1>\r\n<p>Tradicionalmente, el término "formulario" se ha referido a un documento que contiene espacios para que el usuario rellene información.</p>\r\n  <p>HTML toma este concepto para referirse al conjunto de etiquetas que nos permiten recolectar información de los usuarios que visitan nuestro sitio web.</p>\r\n  <p>Así necesitemos colocar una caja de búsqueda o crear multiples formularios para una aplicación, los formularios en HTML nos dan una serie de etiquetas que nos permiten recolectar data de los usuarios. En este unidad aprenderemos:</p>\r\n  <ul>\r\n    <li>Como crear un formulario para nuestro sitio web</li>\r\n    <li>Diversas herramientas para recolectar data</li>\r\n    <li>Formularios HTML5</li>\r\n  </ul>\r\n  <!--<h3>Como funcionan los formularios</h3>\r\n  [insertar video de introducción simple a los formularios] -->\r\n  <h3>Controles de Formularios</h3>\r\n  <ul>\r\n  	<li class="c-item">Agregando Texto</li>\r\n    <p><strong>Entradas de texto:</strong> Utilizado para ingresar una línea de texto como una dirección de correo eletrónico o nombres.</p>\r\n    <p><strong>Entradas de contraseña:</strong> Utilizado para ingresar una línea de texto pero enmascara los caracteres ingresados.</p>\r\n    <strong>Areas de Texto:</strong> Para áreas largas de texto como mensajes o comentarios.\r\n  	<li class="c-item">Tomando Decisiones</li>\r\n    <p><strong>Botones Radiales:</strong> Cuando el usuario necesita seleccionar una sóla opción.</p>\r\n    <p><strong>Casillas de Verificación:</strong> Cuando el usuario puede seleccionar y deseleccionar una o más opciones.</p>\r\n    <p><strong>Casillas desplegables:</strong></p>\r\n  	<li class="c-item">Presentar Formularios</li>\r\n    <p><strong>Botones de Enviar:</strong> Para enviar data desde el formulario hacia otro sitio web.</p>\r\n    <p><strong>Botones de Imagen:</strong> Con una función similar al de los botones de enviar pero con la diferencia de que se pueden enviar imagenes.</p>\r\n    <p><strong>Subiendo archivos:</strong> Para subir archivos directamente a un sitio web.</p>\r\n  </ul>\r\n  <h3>Estructura de Formularios</h3>\r\n  <p>Para comenzar a estructurar un formulario necesitamos la etiqueta <code>&lt;form&gt;</code>. Esta etiqueta soporta diferentes atributos, todos de manera opcional:</p>\r\n  <table>\r\n <thead>\r\n  <tr>\r\n   <th scope="col">Nombre del Atributo</th>\r\n   <th scope="col">Descripción</th>\r\n  </tr>\r\n </thead>\r\n <tbody>\r\n  <tr>\r\n   <td><code>action</code></td>\r\n   <td>Todo formulario requiere de este atributo. Su valor es la URL de la página del servidor que recibirá la información una vez que el formulario sea enviado</td>\r\n  </tr>\r\n  <tr>\r\n   <td><code>method</code></td>\r\n    <td>\r\n      <p>Al momento de enviar un formulario podemos utilizar dos métodos: <code>get</code> o <code>post</code>.</p>\r\n      <h4 class="c-item">method</h4>\r\n      <p>Con este método, los valores del formulario son agregados a la URL que se especifica como valor en el atributo <code>action</code>. Este método es ideal para los siguientes casos:</p>\r\n      <ul>\r\n        <li>Formularios pequeños ( ejemplo: buscadores )</li>\r\n        <li>Cuando estás recibiendo data desde el servidor web ( no enviando información que puede ser agregada o eliminada desde la base de datos )</li>\r\n      </ul>\r\n      \r\n      <h4 class="c-item">post</h4>\r\n      <p>Con este método, los valores son enviado como cabeceras HTTP. Como regla, debes de usar este método si tu formulario:</p>\r\n      <ul>\r\n        <li>Le permite a los usuarios subir archivos</li>\r\n        <li>Es muy largo</li>\r\n        <li>Contiene data sensible ( contraseñas, números de tarjeta de crédito, etc )</li>\r\n        <li>Agrega y/o elimina información desde una base de datos.</li>\r\n      </ul>\r\n      <p><span class="c-item">Nota:</span> En caso de no haber un método definido en el formulario, la información será enviada, por defecto, con el método <code>get</code></p>\r\n    </td>\r\n  </tr>\r\n  <tr>\r\n   <td>\r\n     <code>id</code>\r\n   </td>\r\n    <td><p>Así como usamos este atributo como identificador de otras etiquetas, también podemos usarlo para identificar de manera única a un formulario de los demás. Además, el valor es utilizado con scripts.</p></td>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n  <p>Para conocer sobre más atributos de la etiqueta puedes ingresar a la <a href="https://developer.mozilla.org/en-US/docs/Web/Guide/HTML/Forms/How_to_structure_an_HTML_form">Red de Desarrolladores de Mozilla</a></p>\r\n  <h3>Entradas de Texto</h3>\r\n  <p>Etiqueta <code>&lt;input&gt;</code></p>\r\n  <p>Esta etiqueta es utilizada para crear diferentes categoria de controles para el formularios. El valor del atributo <code>type</code> determina el tipo de entrada se va a crear</p>\r\n  <span class="c-item">type="text"</span>\r\n  <p>Cuando el valor del atributo <code>type</code> es <code>text</code> crea una entrada simple de una sola línea.</p>\r\n  <span class="c-item">name</span>\r\n <p>Cuando los usuarios ingresan información en un formulario, el servidor necesita saber de que control cada dato es ingresado. Por ejemplo, en un formulario de login el servidor necesita saber el dato que se ha ingresado como usuario y como contraseña. Debido a esto, cada control de formulario necesita un atributo <code>name</code>. El valor de este attributo sirve como identificador.</p>\r\n  <span class="c-item">maxlength</span>\r\n  <p>Podemos usar este atributo para limitar el número de caracteres que el usuario vaya a ingresar.</p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="0" data-slug-hash="qNZZwV" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/qNZZwV/">Entradas de Texto</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>Entradas de Contraseña</h3>\r\n  <span class="c-item">type="password"</span>\r\n  <p>Cuando el valor del atributo <code>type</code> es <code>password</code> crea una caja de texto que actúa como una entrada de texto excepto que los caracteres ingresados no pueden verse</p>\r\n  <span class="c-item">name</span>\r\n <p>El valor del atributo indica el nombre de la entrada de contraseña. De esta manera, el servidor recibe la contraseña que el usuario va a ingresar y puede hacer una mejor validación.</p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="0" data-slug-hash="NrNNmQ" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/NrNNmQ/">NrNNmQ</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n<h3>Areas de Texto</h3>\r\n  <p>Etiqueta <code>&lt;textarea&gt;</code></p>\r\n  <p>Esta etiqueta es usada para crear entradas multilineales. A diferencia de la etiqueta <code>input</code> esta etiqueta no es vacía. Es decir, tiene un elemento de apertura y de cierre.</p>\r\n  <p>Todo texto que aprezca entre esta etiqueta aparecerá en la entrada una vez que la página se cargue en el navegador.</p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="0" data-slug-hash="XKddvM" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/XKddvM/">Areas de Texto</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>Botones Radiales</h3>\r\n  <span class="c-item">type="radio"</span>\r\n  <p>Los botones radiales le permiten a los usuarios escoger una sóla opción</p>\r\n  <span class="c-item">name</span>\r\n  <p>Este atributo es enviado al servidor con el valor de la opción que el usuario selecciona. Cuando una pregunta se le hace al usuario con la opción de escoger diversas respuestas con botones radiales el valor de este atributo debe de ser el mismo para todos los botones radiales de todas las respuestas.</p>\r\n  <span class="c-item">value</span>\r\n  <p>Este atributo indica el valor que es enviado al servidor para la opción seleccionada. El valor de cada uno de los botones en el grupo debe de ser diferente para que el servidor sepa cual de ellos el usuario ha seleccionado.</p>\r\n  <span class="c-item">checked</span>\r\n  <p>Este atributo sirve para indicar si un valor debería de estar seleccionado por defecto cuando la página cargue. Su valor es <code>checked</code></p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="0" data-slug-hash="rLeLNy" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/rLeLNy/">Botones Radiales</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>Checkboxes</h3>\r\n  <span class="c-item">type="checkbox"</span>\r\n  <p>Los checkboxes le permiten al usuario seleccionar y deseleccionar una o más opciones al responder una pregunta.</p>\r\n  <span class="c-item">name</span>\r\n  <p>El valor de este atributo es enviado al servidor con el valor de la opción o opciones que el usuario selecciona.</p>\r\n  <span class="c-item">value</span>\r\n  <p>El valor de este atributo le dice al servidor si el usuario ha marcado el checkbox.</p>}\r\n  <span class="c-item">checked</span>\r\n  <p>Este atributo sirve para indicar si un valor debería de estar seleccionado por defecto cuando la página cargue. Su valor es <code>checked</code></p>\r\n  <h3>Lista desplegable de cajas</h3>\r\n  <p>Una lista desplegable de cajas, también conocida como una caja seleccionable, nos permite seleccionar una opción desde una lista desplegable utilizando la etiqueta <code>&lt;select&gt; &lt;/select&gt;</code> que a su vez contiene las opciones envueltas en la etiqueta <code>&lt;option&gt; &lt;/option&gt;</code></p>\r\n  <span class="c-item">name</span>\r\n  <p>Este atributo indica el nombre del control de formulario que será enviado al servidor junto con el valor que el usuario seleccionó</p>\r\n  <span class="c-item">value</span>\r\n  <p>La etiqueta <code>&lt;option&gt; &lt;/option&gt;</code> contiene este atributo para indicar el valor que es enviado al servidor</p>\r\n  <span class="c-item">selected</span>\r\n  <p>Este atributo puede ser usado para indicar la opción que debería estar seleccionada por defecto una vez que la página se carga. Su valor es <span class="c-item">selected</span></p>\r\n  <p>Si este atributo no es utilizado por defecto la primera opción será mostrada una vez que la página cargue</p>\r\n  <p>La función de estas listas desplegables es similar a los botones radiales. Podemos usarla para el caso donde tenemos una lista muy larga de opciones.</p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="0" data-slug-hash="bepLvz" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/bepLvz/">bepLvz</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>Cajas de Selección Múltiple</h3>\r\n  <span class="c-item">size</span>\r\n  <p>Podemos hacer que una caja de selección desplegable nos muestre más de una opción utilizando este atributo. Su valor debe de ser el número de opciones que deseemos mostrar al mismo tiempo</p>\r\n  <span class="c-item">multiple</span>\r\n  <p>Podemos permitirle al usuario seleccionar múltiples opciones de una lista agregando este atributo con un valor de <span class="c-item">multiple</span></p>\r\n  <p data-height="265" data-theme-id="0" data-slug-hash="qNZoNo" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/qNZoNo/">qNZoNo</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  \r\n  <h3>Caja de entrada para archivos</h3>\r\n  <p>Si queremos que los usuarios puedan subir archivos necesitamos una caja de entrada para archivos</p>\r\n  <span class="c-item">type="file"</span>\r\n  <p>Este tipo de entradas crea una caja que se ve como una entrada de texto seguido de un botón que nos sirve para navegar por nuestra computadora y seleccionar el archivo. Dependiendo del navegador el botón puede decir "Browse" ( navegar en inglés) o Choose File ( Escoge un archivo )</p>\r\n  <p>Cuando le permitimos al usuario subir archivos, el valor del atributo <span class="c-item">method</span> perteneciente a la etiqueta <code>&lt;form&gt; &lt;/form&gt; debe de ser <span class="c-item">post</span></code></p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="0" data-slug-hash="WxwzjQ" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/WxwzjQ/">Cajas de Entrada para Archivos</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  \r\n  <h3>Botón Enviar</h3>\r\n  <p>Este botón es utilizado para enviar el formulario al servidor.</p>\r\n  <span class="c-item">name</span>\r\n  <p>Este atributo sirve para los botones pero es de manera opcional</p>\r\n  <span class="c-item">value</span>\r\n  <p>Este atributo se utiliza para controlar el texto que aparece en el botón. Siempre es una buena práctica especificar lo que queremos que diga nuestro botón y no confiarnos en los nombres que cada navegador pone por defecto</p>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="0" data-slug-hash="OXNvQJ" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/OXNvQJ/">Botón Enviar</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  \r\n  <h3>Botón para Imágenes</h3>\r\n  <span class="c-item">type="image"</span>\r\n  <p>Si queremos usar una imagen para nuestro botón de envío, podemos darle como valor al atributo <span class="c-item">type</span> de <span class="c-item">image</span></p>\r\n  <h3>Etiquetando los controles de formulario</h3>\r\n  <p>Etiqueta <code>&lt;label&gt;&lt;/label&gt;</code></p>\r\n  <p>Esta etiqueta nos ayuda a nombrar los controles de formulario y así lo hace más entendible para aquellos usuarios con discapacidad. Podemos usar esta etiqueta en dos casos:</p>\r\n  <ol>\r\n    <li>Envolver el texto de descripción y la entrada de texto</li>\r\n    <li>Separar el texto de descripción de la entrada y usar el atributo <code>for</code> para indicar a cual entrada la pertenece.</li>\r\n  </ol>\r\n  <h4>Ejemplo</h4>\r\n  <p data-height="265" data-theme-id="0" data-slug-hash="OXNvQJ" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/OXNvQJ/">Botón Enviar</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 5, 'blog', '', 1, NULL, NULL, NULL),
(44, 'Autoevaluación', '2016-07-15 20:47:38', '2016-07-21 16:35:54', 'retrospective', 12, NULL, '', NULL, NULL, NULL, NULL, 9, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 5, '', 'https://laboratoriala.typeform.com/to/K9c57S', 1, NULL, NULL, NULL),
