(47, 'Pre-trabajo', '2016-07-18 06:01:10', '2016-09-12 22:07:31', 'prework', 1, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n \r\n  .page-container ul {\r\n  	font-size: 24px;\r\n  	color: #606060;\r\n  }\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n    font-size: 16px;\r\n  	color: #606060;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n  <div class="text-center">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/prework.jpg" height="200px"/>\r\n    <p class="line">Los siguientes links dan algunos alcances de lo que es CSS</p>\r\n<p>En esta sección vamos a conocer tres temas importantes acerca de CSS.</p>\r\n  <ul>\r\n    <li><a href="#css">¿Qué es CSS?</a></li>\r\n    <li><a href="#cssvideo">¿Qué es CSS?(Video)</a></li>\r\n    <li><a href="#cssunits">Unidades usadas en CSS</a></li>\r\n    <li><a href="#csscolors">Colores usandos en CSS</a></li>\r\n  </ul>\r\n  <h2 id"css">¿Qué es CSS?</h2>\r\n  <p>Así como HTML es el lenguaje que usamos para definir la estructura del contenido de nuestro sitio. El lenguaje crea reglas que especifican como el contenido de un elemento debería de verse.</p>\r\n  <p>Por ejemplo, podemos especificar el color de fondo de una página o el tamaño de los párrafos o el tipo de letra del sitio.</p>\r\n  \r\n  <p>Una vez que aprendamos como sobre las reglas de CSS, lo demás se trata de conocer que propiedades tienes el lenguaje para ofrecernos</p>\r\n  \r\n  <h3>Entendiendo CSS</h3>\r\n  <p>La clave para entender como funciona CSS es imaginar que existe una caja invisible alrededor de cada elemento HTML</p>\r\n  <p>En el siguiente ejemplo, se muestra un grupo de elementos que están envueltos en una caja ( <code>&lt;div id="text"&gt;&lt;/div&gt;</code> ) en la cual le he colocado un borde para mostrar como es que CSS trata los elementos HTML</p>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="pbyYdE" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/pbyYdE/">CSS, Cajas</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>Elementos bloque e inline</h3>\r\n  <p>En la sección anterior hablábamos sobre los elementos que por defecto son de tipo bloque y de tipo inline. En el siguiente ejemplo les voy a mostrar como se ven dichos elementos para tener una idea más clara de como funcionan</p>\r\n  <p data-height="265" data-theme-id="dark" data-slug-hash="dXMLXx" data-default-tab="html,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/dXMLXx/">CSS, Bloque, Inline</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  <h3>CSS y su asociación con HTML</h3>\r\n  <p>CSS trabaja asociando sus reglas hacia los elementos HTML. Estas reglas dictaminan como el contenido de elementos específicos debe de verse. Una regla de CSS consta de dos partes: <span class="c-item">selector</span> y <span class="c-item">declaración</span></p>\r\n  <img src="http://i.imgur.com/mvF8GzQ.png"/>\r\n  <p>Los <span class="c-item">selectores</span> indican el elemento al que se aplica la regla. La misma regla de CSS puede ser aplicada a múltiples elementos si separamos los elementos con comas.</p>\r\n  <p>Las <span class="c-item">declaraciones</span> indican como debe de ser el estilo de los elementos HTML mencionados en el selector.</p>\r\n  <h3>Las propiedades de CSS afectan como los elementos de HTML deben verse</h3>\r\n  <p>Como podemos ver en la imagen anterior, las declaraciones CSS se colocan dentro de los corchetes y cada declaración esta dividad en dos partes: <span class="c-item">propiedad</span> y <span class="c-item">valor</span></p>\r\n  <img src="http://i.imgur.com/v3RRKoQ.png?1" />\r\n  <p>Las <span class="c-item">propiedades</span> indica los aspectos de/los elementos que se desean cambiar.</p>\r\n  <p>Los <span class="c-item">valores</span> especifican la configuración que se desea usar para las propiedades elegidas.</p>\r\n  <h2>Formas de llamar a tus hojas de estilo</h2>\r\n  <p>Así como existe uno o multiples archivos con formatos <code>.html</code> donde escribimos la estructura de nuestro sitio, también tenemos archivos con formato <code>.css</code> que son en donde escribiremos las declaraciones que querramos para estilizar nuestros proyectos. Sin embargo, para que estas declaraciones se apliquen a las páginas debemos llamar a los archivos.</p>\r\n  <p>Existen 2 maneras:</p>\r\n  <ul>\r\n    <li>\r\n      <h3>Usando CSS de forma externa</h3>\r\n      <p>Para poder importar un archivo ( u hoja de estilo ) necesitamos usar la etiqueta <code>&lt;link&gt;</code> esta etiqueta sirve para decirle al navegador donde puede encontrar dicha hoja de estilo que servirá para estilizar la página. Esta etiqueta no tienen un elemento de cierre y se coloca dentro de la sección <code>&lt;head&gt; &lt;/head&gt;</code> del documento HTML</p>\r\n      <h4>Atributo <span class="c-item">href</span></h4>\r\n      <p>Este atributo especifica la ruta del archivo CSS, el cual usualmente está colocado en un archivo llamado CSS o Estilos.</p>\r\n      \r\n      <h4>Atributo <span class="c-item">type</span></h4>\r\n      <p>Este atributo especifica el typo de documento que se va a importar</p>\r\n      \r\n      <h4>Atributo <span class="c-item">rel</span></h4>\r\n      <p>Este atributo especifica la relación que hay entre la página HTML y el archivo que se está importando. Su valor es <span class="c-item">stylesheet</span></p>\r\n    </li>\r\n    \r\n    <li>\r\n      <h3>Usando CSS de forma interna</h3>\r\n      <p>También podemos incluir declaraciones CSS dentro de la misma página HTML. Para esto utilizamos la etiqueta <code>&lt;style&gt; &lt;/style&gt;</code></p>\r\n    </li>\r\n  </ul>\r\n  <p>Cuando estamos creando sitios con más de una página, debemos de llamar siempre a los estilos de manera externa por las siguientes razones:</p>\r\n  <ul>\r\n    <li>Permite que todas las páginas utilicen las mismas reglas de estilización, en vez de tener que repetirlas en cada página.</li>\r\n    <li>Mantiene el contenido separado de la presentación de la página.</li>\r\n    <li>Si necesitamos hacer cambios, tenemos la oportunidad de hacerlo una sola vez.</li>\r\n  </ul>\r\n\r\n      <h3 id="cssvideo">¿Qué es CSS? Video</h3>\r\n      <center>\r\n     	 <iframe width="560" height="315" src="https://www.youtube.com/embed/24gNhTcy6pw?showinfo=0" frameborder="0" allowfullscreen></iframe>\r\n      </center>\r\n      <h3 id="cssunits">Unidades de medida que se usan en CSS</h3> \r\n      <center>\r\n     	 <iframe width="560" height="315" src="https://www.youtube.com/embed/BTv5Etachw0?showinfo=0" frameborder="0" allowfullscreen></iframe>\r\n      </center>\r\n      <h3 id="csscolors">Unidades de color que usaremos en CSS</h3>\r\n      <center>\r\n     	 <iframe width="560" height="315" src="https://www.youtube.com/embed/XHkcNr93xoE?showinfo=0" frameborder="0" allowfullscreen></iframe>\r\n      <center>\r\n\r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, 45, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 6, '', '', 0, '', NULL, NULL),
(49, 'Pre-Trabajo', '2016-07-18 07:02:26', '2016-07-19 15:38:04', 'prework', 1, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n    font-size: 24px;\r\n  	color: #606060;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n  \r\n</style>\r\n<div class="blog p-21">\r\n  <div class="text-center">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/prework.jpg" height="200px"/>\r\n    <h2>Selectores</h2>\r\n    <p class="line">Puedes ver un intro a Selectores en el siguiente video.</p>\r\n    <center>\r\n    <iframe width="560" height="315" src="https://www.youtube.com/embed/uqkj7HQ7ids?showinfo=0" frameborder="0" allowfullscreen></iframe>\r\n    </center>\r\n    <hr>\r\n    <p>Además puedes revisar los siguientes links para profundizar el tema</p>\r\n    <ul>\r\n      <li><a href="http://librosweb.es/libro/css/capitulo_2.html" target="_blank">Selectores</a></li>     \r\n      <li><a href="http://codexexempla.org/curso/curso_3_6.php" target="_blank">Herencia y Cascada</a></li>     \r\n      <li><a href="http://code.tutsplus.com/es/tutorials/the-30-css-selectors-you-must-memorize--net-16048" target="_blank">30 selectores CSS que deberías memorizar. (Inglés)</a></li>        \r\n    </ul>\r\n     \r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, 45, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 7, '', '', 0, NULL, NULL, NULL);
