(50, 'What''s next?', '2016-07-18 07:11:43', '2016-07-18 12:24:31', 'material', 4, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n \r\n  .page-container ul {\r\n  	font-size: 24px;\r\n  	color: #606060;\r\n  }\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n    padding-top:1.5em;\r\n    padding-bottom:1.2em;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n    font-size: 16px;\r\n  	color: #606060;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  .blog table{\r\n  	border:1px #030303 solid;\r\n  }\r\n  \r\n  .blog th{\r\n  	text-transform:uppercase;\r\n    text-align:center;\r\n    background-color: #f9a91a;\r\n    color: white;\r\n  }\r\n  .blog th, .blog td{\r\n  	padding:1em;\r\n  }\r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n  \r\n    \r\n  .btn-course {\r\n  	background-color: #62D1B7;\r\n  	border: 1px solid #62D1B7;\r\n  }\r\n  \r\n  .welcome-page-container {\r\n     margin-top: 60px;\r\n  }\r\n  \r\n  .welcome-page-container h1 {\r\n  	font-size: 42px;\r\n    margin: 20px 0px 20px 0px;\r\n  }\r\n  \r\n  .welcome-page-container p {\r\n  	margin: 23px 0px 30px 0px;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n  <div class="text-center welcome-page-container">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/whats-next2.jpg"/>\r\n  \r\n  \r\n    <h1>Manual de Referencia de CSS</h1>\r\n	<h2>Selectores CSS</h2>\r\n  	<p>Existen muchos tipos de selectores CSS que nos permiten orientar las reglas a elementos específicos de nuestro documento HTML. Los selectores son estrictos entre mayúscula y minúsculas.</p>\r\n  	<p>Los tipos de selectores básicos son:</p>\r\n  	<table border="1">\r\n      <thead>\r\n        <tr>\r\n          <th scope="col">Selector</th>\r\n          <th scope="col">Significado</th>\r\n          <th scope="col">Ejemplo</th>\r\n        </tr>\r\n      </thead>\r\n      <tbody>\r\n        <tr>\r\n          <td>Universal</td>\r\n          <td>Aplica para todo elemento en el documento HTML</td>\r\n          <td><code>* {}</code> <br /> Apunta a todos los elementos del documento HTML</td>\r\n        </tr>\r\n\r\n        <tr>\r\n          <td>Selector de Caracter</td>\r\n          <td>Iguala a los nombres del elemento</td>\r\n          <td><code>h1,h2,h3 {}</code> <br /> Apunta a todos los elementos <code>&lt;h1&gt;</code>, <code>&lt;h2&gt;</code>, <code>&lt;h3&gt;</code></td>\r\n        </tr>\r\n\r\n        <tr>\r\n          <td>Selector de Clase</td>\r\n          <td>Coincide con un elemento cuyo atributo de <code>class</code> tiene un valor que coincida con el especificado después del punto ( <code>.</code> )</td>\r\n          <td><code>.note {}</code> <br /> Apunta a cualquier elemento cuyo atributo <code>class</code> tiene un valor de <strong>note</strong> <br /> <code>p.note {}</code> Apunta únicamente a los elementos <code>&lt;p&gt;</code> cuyo atributo <code>class</code> tenga un valor de <strong>note</strong></td>\r\n        </tr>\r\n\r\n        <tr>\r\n          <td>Selector de ID</td>\r\n          <td>Coincide con un elemento cuyo atributo de <code>id</code> tiene un valor que coincida con el especificado después del símbolo de la almohadilla ( <code>#</code> )</td>\r\n          <td><code>.note {}</code> <br /> Apunta a cualquier elemento cuyo atributo <code>class</code> tiene un valor de <strong>note</strong> <br /> <code>p.note {}</code> Apunta únicamente a los elementos <code>&lt;p&gt;</code> cuyo atributo <code>class</code> tenga un valor de <strong>note</strong></td>\r\n        </tr>\r\n\r\n        <tr>\r\n          <td>Selector de elemento hijo</td>\r\n          <td>Coincide con un elemento que es un hijo directo de otro lemento</td>\r\n          <td><code>li>a</code> <br /> Apunta a cualquier elemento <code>&lt;a&gt;</code> que sea un hijo directo del elemento <code>&lt;li&gt;</code></td>\r\n        </tr>\r\n\r\n        <tr>\r\n          <td>Selector de elemento descendiente</td>\r\n          <td>Coincide con un elemento que descienda de otro ( No tiene que ser un hijo directo, puede ser cualquier elemento que esté contenido dentro de otro )</td>\r\n          <td><code>p a {}</code> <br /> Apunta a cualquier elemento <code>&lt;a&gt;</code> que se encuentre dentro de cualquier elemento <code>&lt;p&gt;</code></td>\r\n        </tr>\r\n\r\n        <tr>\r\n          <td>Selector de elemento hermano adyacente</td>\r\n          <td>Coincide con un elemento que sea el hermano directo de otro</td>\r\n          <td><code>h1+p {}</code> <br /> Apunta <strong>sola y únicamente</strong> al primer elemento <code>&lt;p&gt;</code> que esté luego del elemento <code>&lt;h1&gt;</code></td>\r\n        </tr>\r\n\r\n        <tr>\r\n          <td>Selector de elemento hermano general</td>\r\n          <td>Coincide con un elemento que sea el hermano de otro y no necesariamente tiene que ser directo.</td>\r\n          <td><code>hi~p</code ><br /> Si tuvieramos dos elementos <code>&lt;p&gt;</code> que son hermanos de un elemento <code>&lt;h1&gt;</code> este selector apunto a ambos.</td>\r\n        </tr>\r\n      </tbody>\r\n  	</table>\r\n  	<hr>\r\n 	<h3>Reglas CSS y el concepto de Cascada</h3>\r\n      <p>Recordemos que el acrónimo CSS significa Hoja de Estilo de <strong>Cascada</strong>. El concepto de cascada se aplica cuando tenemos dos reglas que van hacia el mismo elemento. Cuando esto sucede es importante entender cual de estas reglas tendrá lugar.</p>\r\n      <h4 class="c-item">Ultima regla</h4>\r\n      <p>Si ambos selectores son idénticos, la última regla es la que tomará el lugar.</p>\r\n      <h4>Ejemplo</h4>\r\n      <p data-height="265" data-theme-id="dark" data-slug-hash="zBBLKN" data-default-tab="css,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/zBBLKN/">Cascada</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n    <script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n      <h4 class="c-item">Especificación</h4>\r\n      <p>Si un selector es más específico que otro, la regla con el selector más específico va a tomar lugar</p>\r\n      <p data-height="265" data-theme-id="dark" data-slug-hash="beejqP" data-default-tab="css,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/beejqP/">Especificación</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n    <script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n      <p>En este ejemplo podemos notar que a pesar de que el valor la propiedad <code>color</code> del elemento <code>h1</code> que está de últimas sea <code>white</code> como el navegador encuentra un selector más específico <code>h1.titulo</code> el valor de la propiedad que pertenece a el, es la que prevalece.</p>\r\n      <h4 class="c-item">Important</h4>\r\n      <p>Si queremos forzar la prioridad de una regla en CSS, podemos usar <code>!important</code>. Sin embargo este método sólo debe de ser usado en casos muy extremos, dado que si ya conocemos como funciona la cascada y la especificación podemos diagramar mejor como queremos que nuestras reglas tomen ( o no ) prioridad.</p>\r\n      <hr>\r\n      <h3>Herencia</h3>\r\n      <p>Si especificamos alguna regla dentro del elemento <code>body</code> estas se aplicaran a muchos de sus elementos hijos. Esto sucede gracias al concepto de herencia. </p>\r\n        <p>El elemento <code>body</code>, por ser un elemento que trabaja como un contenedor de otros elementos, es un <strong>elemento padre</strong> y gracias a esto, las propiedades que se le asignan son heredadas por los demás elementos.</p>\r\n      <p>También podemos forzar que ciertas propiedades sean heredas con el valor <code>inherit</code> </p>\r\n      <p data-height="265" data-theme-id="dark" data-slug-hash="qNNyoo" data-default-tab="css,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/qNNyoo/">Herencia</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n    <script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n    <hr>\r\n    <center>\r\n    <h3>Otros Recursos</h3>\r\n    <p class="line">Si quieres conocer más sobre los selectores <br> puedes ver los siguientes links:</p>\r\n    <ul>\r\n      <li><a href="http://learn.shayhowe.com/advanced-html-css/complex-selectors/" target="_blank">CSS:Selectores complejos</a></li>\r\n      <li><a href="http://www.htmlhelp.com/es/reference/css/structure.html" target="_blank">Estructura y reglas de css.</a></li>\r\n    </ul>\r\n  	</center>\r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 6, 'blog', '', 0, NULL, NULL, NULL),
