(58, 'Ejercicio: Juego de los platos', '2016-07-19 17:13:14', '2016-07-19 17:19:31', 'exercise', 3, NULL, '', NULL, NULL, NULL, NULL, 20, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, ' \r\n##Indicaciones\r\n\r\n 1. Ingresar al link de juegos y resolver los 26 niveles.\r\n 2. El juego consiste en que selecciones, usando los ids selectores y pseudo clases adecuadas para cada caso. \r\n 3. Tomar un screenshot cuando el Juego este terminado comunicar a tu Jedi Master para que pueda indicar que has terminado el ejercicio. \r\n\r\n[Link del Juego][1]\r\n\r\n\r\n  [1]: http://capitan-dev.laboratoria.la/restaurant.html', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 7, '', '', 1, NULL, NULL, NULL),
(59, 'What''s next? ', '2016-07-19 18:53:19', '2016-07-19 20:58:57', 'material', 5, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n \r\n  .page-container ul {\r\n  	font-size: 24px;\r\n  	color: #606060;\r\n  }\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n    padding-top:1.5em;\r\n    padding-bottom:1.2em;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n    font-size: 16px;\r\n  	color: #606060;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  .blog table{\r\n  	border:1px #030303 solid;\r\n  }\r\n  \r\n  .blog th{\r\n  	text-transform:uppercase;\r\n    text-align:center;\r\n    background-color: #f9a91a;\r\n    color: white;\r\n  }\r\n  .blog th, .blog td{\r\n  	padding:1em;\r\n  }\r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n  \r\n    \r\n  .btn-course {\r\n  	background-color: #62D1B7;\r\n  	border: 1px solid #62D1B7;\r\n  }\r\n  \r\n  .welcome-page-container {\r\n     margin-top: 60px;\r\n  }\r\n  \r\n  .welcome-page-container h1 {\r\n  	font-size: 42px;\r\n    margin: 20px 0px 20px 0px;\r\n  }\r\n  \r\n  .welcome-page-container p {\r\n  	margin: 23px 0px 30px 0px;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n  <div class="text-center welcome-page-container">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/whats-next2.jpg"/>\r\n    <p>Revisa con detenimiento los siguientes links:</p>\r\n    <ul>\r\n      <li><a href="http://capitan-dev.laboratoria.la/tracks/1/courses/4/units/3/lessons/8/pages/60">Manual de referencia: Control de dimensiones</a></li>\r\n      <li><a href="http://capitan-dev.laboratoria.la/tracks/1/courses/4/units/3/lessons/8/pages/61">Manual de referencia: Border, padding, margin, display</a></li>\r\n      <li><a href="https://www.smashingmagazine.com/2009/07/the-definitive-guide-to-using-negative-margins/" target="_blank">The definitive Guide of Negative Margins</a></li>\r\n      <li><a href="http://www.w3.org/WAI/GL/css2em.htm" target="_blank">The amazing em unit and other best practices</a></li>\r\n    </ul>\r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 8, 'blog', '', 0, NULL, NULL, NULL),
(60, 'Control de dimensiones', '2016-07-19 20:07:05', '2016-07-19 20:35:12', 'material', 3, NULL, '<style>\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n	<p>En esta sección verás algunos alcances de control de las dimensiones de las cajas.</p>\r\n	<br>\r\n	<h3>Dimensiones de Cajas</h3>\r\n	<p>Por defecto, una caja está dimensionada lo suficientemente grande como para que sus contenidos puedan caber. Para establecer nuestras propias dimensiones podemos usar las propiedades <code>width</code> y <code>height</code></p>\r\n	<p>Los valores más usados para especificar las dimensiones de una caja son los pixeles, porcentajes o ems. Tradicionalmente, los pixeles han sido el método más popular debido a que le permite a los diseñadores controlar con mayor precisión.</p>\r\n	<p>Cuando usamos porcentajes la dimensión de la caja es relativa a la dimensión de la ventana del navegador o si es que a caja está contenida dentro de otra, su dimensión depende del tamaño de la caja que la contiene</p>\r\n	<p>Cuando usamos ems, el tamaño de la caja se basa en el tamaño del texto que lo contiene.</p>\r\n	<p>Los diseñadores han comenzado a usar porcentajes y ems dado que cada vez existen más dispositivos desde donde el usuario puede visualizar los proyectos.</p>\r\n	<h4>Ejemplo</h4>\r\n	<p data-height="465" data-theme-id="dark" data-slug-hash="pbbqze" data-default-tab="css,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/pbbqze/">Dimensiones Caja</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n	<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n	<h3 class="c-item">Anchos Limitados</h3>\r\n	<p>Algunos diseños web amplían o reducen su tamaño para encajar con las dimensiones de la pantalla del usuario. Para estos diseños la propiedad <code>min-width</code> especifica el tamaño mínimo que debe de tener una caja al momento de ser mostrada cuando la ventana del navegador es estrecha y la propiedad <code>max-width</code> determina el tamaño máximo de la caja.</p>\r\n	<p>Por ejemplo, podemos usar max-width para asegurar que las líneas de texto no se vean tan separadas cuando tu sitio se vea en una ventana de navegador muy ancha y al mismo tiempo se puede usar min-width para que estas líneas se no se vean tan estrechas</p>\r\n	<p data-height="465" data-theme-id="dark" data-slug-hash="MeeZZX" data-default-tab="css,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/MeeZZX/">max and min width</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n	<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n	<h3 class="c-item">Altos Limitados</h3>\r\n	<p>De la misma manera en que podemos limitar el ancho de una caja, quizá también busquemos limitar su alto. Esto se consigue utilizando las propiedades <code>min-height</code> y <code>max-height</code></p>\r\n	<p>En el ejemplo podemos ver esta propiedad en acción y también podemos ver que es lo que pasa cuando el contenido de la caja toma mucho más espacio que la dimensión especificada de la caja.</p>\r\n	<p data-height="265" data-theme-id="dark" data-slug-hash="LZRPvW" data-default-tab="css,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/LZRPvW/">min and max height</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n	<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n	<h3>Cuando el contenido se desborda</h3>\r\n	<p>La propiedad <code>overflow</code> le dice al navegador que tiene que hacer si el contenido que está dentro de una caja es más grande que las dimensiones de la caja. Esta propiedad consta de dos valores:</p>\r\n	<code>hidden</code> \r\n	<p>Este sirve para esconder el contenido que pueda estar sobrando o que no cabe dentro de la caja.</p>\r\n	<code class="c-item">scroll</code>\r\n	<p>El valor de esta propiedad agrega una barra de desplazamiento a la caja para que los usuarios puedan desplazarse y leer el contenido que no puedan ver.</p>\r\n	<h4>Ejemplo</h4>\r\n	<p data-height="450" data-theme-id="dark" data-slug-hash="PzGoZy" data-default-tab="css,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/PzGoZy/">overflow</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n	<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n	<p>Así como los elementos de texto, las cajas tienen propiedades que son claves para su estilización. Para conocerlas mejor debes ir a la sección de <a href="http://seleccion.laboratoria.la/mycourses/3/u/9/p/196">Margenes, Relleno y Borde</a></p>\r\n  </div>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 8, 'blog', '', 1, NULL, NULL, NULL),
(61, 'Border, padding, margin, display', '2016-07-19 20:34:32', '2016-07-19 20:37:39', 'material', 4, NULL, '<style>\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n    <p>Toda caja tiene a su disposición propiedades que cambian para el control de su apariencia y comportamiento:</p>\r\n\r\n	<h3 class="c-item">Border</h3>\r\n	<p>Toda caja tiene un borde ( a pesar de que en muchos casos no sea visible o tenga 0 de ancho ). El borde separa las afueras de una caja de otra.</p>\r\n	<p>Esta propiedad nos permite usar los siguientes estilos: </p>\r\n	<h4 class="c-item">border-width</h4>\r\n	<p>Para ayudarnos a controlar el ancho del borde. El valor puede ser determinado en pixeles o usando uno de estos valores:</p>\r\n	<ul>\r\n		<li>Thin</li>\r\n		<li>Medium</li>\r\n		<li>Thick</li>\r\n	</ul>\r\n	<p><strong>Nota:</strong> No se pueden usar porcentajes como valores para esta propiedad.</p>\r\n	<p>También podemos controlar el ancho de cada uno de los 4 lados usando <span class="c-item">border-top-width</span>, <span class="c-item">border-right-width</span>, <span class="c-item">border-bottom-width</span>, <span class="c-item">border-left-width</span> </p>\r\n	<img class="show" src="http://i.imgur.com/BZXe79X.png" /><img class="show" src="http://i.imgur.com/YuS5swa.png" />\r\n	<h4 class="c-item">border-style</h4>\r\n	<p>Con esta propiedad podemos controlar el tipo del borde que queremos que se vea. Esta propiedad contiene los siguientes valores</p>\r\n	<ul>\r\n		<li><span class="c-item">solid:</span> una sola línea continua.</li>\r\n		<div style="border:1px solid #f9a91a; padding:5px 7px; margin: 15px 10px;">Cajita</div><br>\r\n		<li><span class="c-item">dotted:</span> línea hecho de puntos cuadrados.</li>\r\n		<div style="border:1px dotted #f9a91a; padding:5px 7px; margin:15px 10px;">Cajita</div><br>\r\n		<li><span class="c-item">dashed:</span> serie de líneas pequeñas.</li>\r\n		<div style="border:1px dashed #f9a91a; padding:5px 7px; margin:15px 10px;">Cajita</div><br>\r\n		<li><span class="c-item">double:</span> dos líneas sólidas continuas.</li>\r\n		<div style="border:1px double #f9a91a; padding:5px 7px; margin:15px 10px;">Cajita</div><br>\r\n		<li><span class="c-item">groove:</span> borde con la apariencia de estar tallado en la página.</li>\r\n		<div style="border:1px groove #f9a91a; padding:5px 7px; margin:15px 10px;">Cajita</div><br>\r\n		<li><span class="c-item">ridge:</span> borde con la apariencia de sobresalir de la página.</li>\r\n		<div style="border:1px ridge #f9a91a; padding:5px 7px; margin: 15x 10px;">Cajita</div><br>\r\n		<li><span class="c-item">inset:</span> borde con la apariencia de estar incrustado en la página.</li>\r\n		<div style="border:1px inset #f9a91a; padding:5px 7px; margin: 15x 10px;">Cajita</div><br>\r\n		<li><span class="c-item">outset:</span> borde con la apariencia de salir de la pantalla.</li>\r\n		<div style="border:1px outset #f9a91a; padding:5px 7px; margin:15px 10px;">Cajita</div><br>\r\n		<li><span class="c-item">hidden/none:</span> sin borde.</li>\r\n		<div style="border:1px hidden #f9a91a; padding:5px 7px; margin:15px 10px;">Cajita</div><br>\r\n	</ul>\r\n	<h4>Ejemplo</h4>\r\n	<p data-height="465" data-theme-id="dark" data-slug-hash="bewZaJ" data-default-tab="css,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/bewZaJ/">border-style</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n	<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n  \r\n          <h4 class="c-item">border-color</h4>\r\n          <p>Con esta propiedad podemos especificar el color de los border utilizando valores RGB, códigos hexadecimales o nombres predeterminados por el CSS</p>\r\n          <p>Así como con <span class="c-item">border-width</span> podemos controlar el color de los 4 lados de manera individual usando:</p>\r\n          <ul>\r\n            <li class="c-item">border-top-color</li>\r\n            <li class="c-item">border-right-color</li>\r\n            <li class="c-item">border-bottom-color</li>\r\n            <li class="c-item">border-left-color</li>\r\n          </ul>\r\n          \r\n          <img class="show" src="http://i.imgur.com/rrDTIEh.png" />\r\n          <img class="show" src="http://i.imgur.com/r9Y4y5G.png" />\r\n        </li>\r\n      </ul>\r\n\r\n     <h2 class="c-item">Margin</h2>\r\n	<p>Los márgenes son espacios que se encuentran fuera de los bordes de la caja. Podemos crear un ancho de margen para crear un vacío entre los bordes de dos cajas adyacentes.</p>\r\n	<p>Podemos especificar los valores para cada lado de la caja usando:</p>\r\n	<ul>\r\n	    <li class="c-item">margin-top</li>\r\n	    <li class="c-item">margin-right</li>\r\n	    <li class="c-item">margin-bottom</li>\r\n	    <li class="c-item">margin-left</li>\r\n	</ul>\r\n      \r\n	<h4>Ejemplo</h4>\r\n	<p data-height="465" data-theme-id="dark" data-slug-hash="rLWxjz" data-default-tab="css,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/rLWxjz/">margins</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n	<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n\r\n	<h2 class="c-item">Padding</h2>\r\n	<p>El relleno ( padding, en inglés ) es el espacio entre el borde de una caja y cualquier contenido que se encuentra dentro de la caja. Agregar padding puede aumentar tanto el ancho de la caja como la legibilidad de sus contenidos</p>\r\n	<img src="http://i.imgur.com/0wYESFH.gif" class="show" />\r\n\r\n	<p>Podemos especificar los valores para cada lado de la caja usando:</p>\r\n	<ul>\r\n	    <li class="c-item">padding-top</li>\r\n	    <li class="c-item">padding-right</li>\r\n	    <li class="c-item">padding-bottom</li>\r\n	    <li class="c-item">padding-left</li>\r\n	</ul>\r\n \r\n	<p><strong>Nota:</strong> Si especificamos un ancho para la caja, los bordes, rellnos y margenes se agregaran tanto a su ancho como a sus altos.</p>\r\n	<h4>Espacios en blanco y margenes verticales</h4>\r\n	<p>Si tenemos una caja que se encuentra encima de otra y ambas contienen márgenes, el valor mayor será el que tome prioridad mientras que el menor será ignorado.</p>\r\n	\r\n	<h4>Ejemplo</h4>\r\n	<p data-height="465" data-theme-id="dark" data-slug-hash="PzGqLe" data-default-tab="css,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/PzGqLe/">White Space</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n	<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n	\r\n	<h4>Centrando Contenido</h4>\r\n	<p>En la mayoria de los proyectos, nos vamos a encontrar con el caso en que necesitamos centrar algunos bloques de contenido. Para realizar esto podemos darle a los márgenes horizontales ( <span class="c-item">margin-left</span> y <span class="c-item">margin-right</span> ) el valor <span class="c-item">auto</span> </p>\r\n	<p>Pero hacer que los márgenes de los lados de la caja sean automáticos no es suficiente, también debemos colocar un ancho a la caja</p>\r\n	\r\n	<h4>Ejemplo</h4>\r\n	<p data-height="465" data-theme-id="dark" data-slug-hash="MebKPO" data-default-tab="css,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/MebKPO/">centrando contenido</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n	<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n	<h3>Display</h3>\r\n	<p>La propiedad <span class="c-item">display</span> nos permite convertir  un elemento inline en un elemento de tipo block o viceversa. También nos ayuda a esconder algún elemento de la página.</p>\r\n	<p>Los valores de la propiedad son:</p>\r\n	 <ul>\r\n	    <li><span class="c-item">inline:</span> Este valor convierte un elemento block en un elemento inline</li>\r\n	    <li><span class="c-item">block:</span> Este valor convierte un elemento inline en un elemento block</li>\r\n	    <li><span class="c-item">inline-block:</span> Este valor hace que un elemento se comporte con si fuera inline pero manteniendo algunas características de un elemento block</li>\r\n	   <li><span class="c-item">none:</span> Este valor esconde un elemento de la página. En estos casos, el elemento actua como si no estuva en la página a pesar de que el elemento se encuentre en el código.</li>\r\n	 </ul>\r\n\r\n	<h4>Ejemplo</h4>\r\n	<p data-height="265" data-theme-id="dark" data-slug-hash="ezBJar" data-default-tab="css,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/ezBJar/">ezBJar</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n	<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n	<h4>Escondiendo Cajas</h4>\r\n	<p>A diferencia del valor <span class="c-item">none</span> de la propiedad <span class="c-item">display</span>, la propiedad <span class="c-item">visibility</span> nos permite esconder cajas de la página pero dejando el espacio que ocapaba dicha caja, en blanco</p>\r\n	<p>Esta propiedad toma 2 valores:</p>\r\n	<ul>\r\n	  <li><span class="c-item">hidden:</span> Este valor esconde el elemento.</li>\r\n	  <li><span class="c-item">visible:</span> Este valor muestra el elemento.</li>\r\n	</ul>\r\n	<p>Como ya mencionamos, la diferencia entre <span class="c-item">display: none;</span> si usamos <span class="c-item">visibility: hidden;</span> para esconder un elemento, quedará un espacio en blanco donde previamente estaba. En caso de que no queramos el espacio, debemos usar la propiedad <span class="c-item">display: none;</span></p>\r\n	<h4>Ejemplo</h4>\r\n	<p data-height="265" data-theme-id="dark" data-slug-hash="LZbNyY" data-default-tab="css,result" data-user="raymicha" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/raymicha/pen/LZbNyY/">visibility</a> by Raymi (<a href="http://codepen.io/raymicha">@raymicha</a>) on <a href="http://codepen.io">CodePen</a>.</p>\r\n	<script async src="//assets.codepen.io/assets/embed/ei.js"></script>\r\n </div>', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 8, 'blog', '', 1, NULL, NULL, NULL),
(62, 'What''s next? ', '2016-07-19 20:49:30', '2016-07-19 20:49:30', 'material', 4, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n \r\n  .page-container ul {\r\n  	font-size: 24px;\r\n  	color: #606060;\r\n  }\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n    padding-top:1.5em;\r\n    padding-bottom:1.2em;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n    font-size: 16px;\r\n  	color: #606060;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  .blog table{\r\n  	border:1px #030303 solid;\r\n  }\r\n  \r\n  .blog th{\r\n  	text-transform:uppercase;\r\n    text-align:center;\r\n    background-color: #f9a91a;\r\n    color: white;\r\n  }\r\n  .blog th, .blog td{\r\n  	padding:1em;\r\n  }\r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n  \r\n    \r\n  .btn-course {\r\n  	background-color: #62D1B7;\r\n  	border: 1px solid #62D1B7;\r\n  }\r\n  \r\n  .welcome-page-container {\r\n     margin-top: 60px;\r\n  }\r\n  \r\n  .welcome-page-container h1 {\r\n  	font-size: 42px;\r\n    margin: 20px 0px 20px 0px;\r\n  }\r\n  \r\n  .welcome-page-container p {\r\n  	margin: 23px 0px 30px 0px;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n  <div class="text-center welcome-page-container">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/whats-next2.jpg"/>\r\n    <ul>\r\n      <li>Puedes revisar algunos <a href="http://learn.shayhowe.com/advanced-html-css/complex-selectors/" target="_blank">Selectores complejos</a></li>\r\n    </ul>\r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 7, 'blog', '', 1, NULL, NULL, NULL),
(63, 'Ejercicio: Modelo de la caja', '2016-07-19 21:12:44', '2016-09-12 22:15:41', 'exercise', 6, NULL, '', NULL, NULL, NULL, NULL, 40, NULL, 0, NULL, 0, 0, '', 'modelo-caja.zip', 'application/zip', 1181, '2016-08-18 21:45:02', '### INSTRUCCIONES\r\n\r\n 1. Dentro de tu carpeta de proyectos, crea un nuevo proyecto llamado **modelo-caja** (Este nombre es **OBLIGATORIO**)\r\n 2. Crea tu repositorio en github con el mismo nombre **modelo-caja**\r\n 3. Descarga el .zip que se encuentra en la sección de Materiales al final de la página. extráelos y añade los archivos a la carpeta modelo-cajas.\r\n 4. Abre el file index.html y realiza las siguientes modificaciones.\r\n\r\n**TIP 1:** Recuerda que tu index debe estar en la raíz de la carpeta.\r\n**TIP 2:** La organización de las sub-carpetas es importante. No olvides re-organizar tus archivos.\r\n![enter image description here][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/box-model.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 8, '', '', 1, '', NULL, NULL),
(64, 'Ejercicio: Margin y Padding', '2016-07-20 15:49:35', '2016-09-12 22:16:01', 'exercise', 7, NULL, '', NULL, NULL, NULL, NULL, 30, NULL, 0, NULL, 0, 0, '', 'ej4-margin-padding.zip', 'application/zip', 14125, '2016-07-20 16:09:40', '### INSTRUCCIONES\r\n\r\n 1. Dentro de tu carpeta de proyectos, crea un nuevo proyecto llamado **margin-padding** (Este nombre es **OBLIGATORIO**)\r\n 2. Crea tu repositorio en github con el mismo nombre **margin-padding**\r\n 3. Descarga el .zip que se encuentra en la sección de Materiales al final de la página, extráelos y añade los archivos a la carpeta **margin-padding**.\r\n 4. Abre el file index.html y realiza las siguientes modificaciones.\r\n\r\n**TIP 1:** Recuerda que tu index debe estar en la raíz de la carpeta.\r\n\r\n**TIP 2:** La organización de las sub-carpetas es importante. No olvides re-organizar tus archivos.\r\n\r\n**TIP 3:** Recuerda subir todas las partes de este ejercicio por separado pero en un único repositorio.\r\n\r\nParte 1\r\n\r\nModifica el index.html y main.css para que generar la siguiente imagen:\r\n\r\n![Parte 1][1]\r\n\r\nParte 2\r\n\r\nModifica el index.html y main.css para que generar la siguiente imagen:\r\n\r\n![Parte 2][2]\r\n\r\nParte 3\r\n\r\nModifica el index.html y main.css para que generar la siguiente imagen:\r\n\r\n![Parte 3][3]\r\n\r\nParte 4\r\n\r\nModifica el index.html y main.css para que generar la siguiente imagen\r\n\r\n![Parte 4][4]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/margin-padding-1.png\r\n  [2]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/margin-padding-2.png\r\n  [3]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/margin-padding-3.png\r\n  [4]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/margin-padding-4.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 8, '', '', 1, '', NULL, NULL),
(65, 'Ejercicio: Márgenes automáticos', '2016-07-20 15:51:58', '2016-09-12 22:17:01', 'exercise', 8, NULL, '', NULL, NULL, NULL, NULL, 30, NULL, 0, NULL, 0, 0, '', 'margenes-automaticos.zip', 'application/zip', 1026, '2016-08-18 21:40:32', '### INSTRUCCIONES\r\n\r\n 1. Dentro de tu carpeta de proyectos, crea un nuevo proyecto llamado **margenes-automaticos** (Este nombre es **OBLIGATORIO**)\r\n 2. Crea tu repositorio en github con el mismo nombre **margenes-automaticos**\r\n 3. Descarga el .zip que se encuentra en la sección de Materiales al final de la página. extráelos y añade los archivos a la carpeta **margenes-automaticos**.\r\n 4. Abre el file index.html y realiza las siguientes modificaciones.\r\n\r\n**TIP 1:** Recuerda que tu index debe estar en la raíz de la carpeta.\r\n**TIP 2:** La organización de las sub-carpetas es importante. No olvides re-organizar tus archivos.\r\n\r\nReproduce en HTML y CSS la imagen que se ve más abajo:\r\n\r\n![Margin Automático][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/margen-automatico.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 8, '', '', 1, '', NULL, NULL),
