(84, 'Ejercicio: Floating', '2016-07-20 23:52:30', '2016-09-12 22:29:06', 'exercise', 3, NULL, '', NULL, NULL, NULL, NULL, 40, NULL, 0, NULL, 0, 0, '', 'floating.zip', 'application/x-zip-compressed', 3128, '2016-07-21 19:37:38', '\r\n### INSTRUCCIONES\r\n\r\n1. Crea un repositorio que se llame floating.\r\n2. Descarga el zip al final del ejercicio, y agregue su contenido al repositorio recién creado\r\n3. Al finalizar todos los pasos, recuerde subir todo a su repositorio (incluyendo la rama **gh-pages**) a GITHUB.\r\n\r\n**Parte 1**\r\n\r\nRecrea esta imagen:\r\n\r\n![Float 1][1]\r\n\r\n**Parte 2**\r\nCambia el floating de los bloques a left. ¿Qué paso?\r\n\r\n**Parte 3**\r\n Cambia el floating a right. ¿Qué pasó ahora?\r\n\r\n**Parte 4**\r\nTe diste cuenta que el borde que los contenía colapso a una sola rayita? Ahora arreglalo… (Tip: busca sobre clearfix)\r\n\r\nAsi debe quedar:\r\n\r\n![Float 2][2]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/float1.png\r\n  [2]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/float4.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 10, '', '', 1, '', NULL, NULL),
