(89, 'Pre-work', '2016-07-21 21:21:09', '2016-08-24 15:52:19', 'prework', 1, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n \r\n  .page-container ul {\r\n  	font-size: 24px;\r\n  	color: #606060;\r\n  }\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n    font-size: 16px;\r\n  	color: #606060;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n  .hidden{\r\n  	display: none;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n  <div class="text-center">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/prework.jpg" height="200px"/>\r\n    <p class="line">Los siguientes links dan algunos alcances de los display types en CSS</p>\r\n    <ul>\r\n      <li><a href="http://librosweb.es/libro/css/capitulo_5.html" target="_blank">Posicionamiento y visualización</a></li><br/>\r\n      <li>W3Schools CSS Positioning Tutorial</li>\r\n      <iframe width="560" height="315" src="https://www.youtube.com/embed/JwyjHyGOgmg" frameborder="0" allowfullscreen></iframe><br/>\r\n      <li><a href="http://www.barelyfitz.com/screencast/html-training/css/positioning/" target="_blank">Aprender positioning en 10 pasos (Inglés)</a></li><br/>\r\n      <li><a href="http://learn.shayhowe.com/advanced-html-css/detailed-css-positioning/" target="_blank">Positioning detallado (Inglés)</a></li><br/>\r\n      <li><a href="http://learnlayout.com/position.html" target="_blank">Aprender Position CSS (Inglés)</a></li>\r\n      <li><a href="http://capitan-dev.laboratoria.la/tracks/1/courses/4/units/3/lessons/11/pages/90" target="_blank">Ejercicio Positioning</a> <b>**OBLIGATORIO**</b></li>\r\n\r\n      <li><a href="http://capitan-dev.laboratoria.la/tracks/1/courses/4/units/3/lessons/11/pages/91" target="_blank">Ejercicio Positioning 2</a></li>\r\n\r\n\r\n    </ul>\r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, 45, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 11, '', '', 0, NULL, NULL, NULL),
(90, 'Ejercicio: Positioning', '2016-07-21 21:53:00', '2016-08-23 19:27:25', 'exercise', 3, NULL, '', NULL, NULL, NULL, NULL, 20, NULL, 0, NULL, 0, 0, '', 'positioning.zip', 'application/zip', 5382, '2016-08-23 16:02:17', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crea una carpeta que se llame **positioning**\r\n 2. Inicializa un repositorio en dicha carpeta, y otro repositorio que se llame **positioning** en GITHUB.\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guarda el contenido en el repositorio. (Una carpeta por paso)\r\n\r\n**Parte 1**\r\n\r\n![Positioning 1][1]\r\n\r\n**Parte 2**\r\n\r\nCambia el “position a relative” a todos los contenedores:\r\n\r\n - ¿Qué cambió? \r\n - Tip: ahora puedes mover este elemento usando top, left,right, bottom\r\n - Experimenta\r\n\r\n**Parte 3**\r\n\r\nAhora logra que se vea así:\r\n\r\n![Positioning 2][2]\r\n\r\n**Parte 4**\r\n\r\nAhora logra que se vea así, pero únicamente modificando el HTML (Tip: explora meter el contenedor azul dentro del rojo)\r\n\r\n![Positioning 3][3]\r\n\r\n**Parte 5**\r\n\r\nAhora vamos a explorar la posición “Absolute” para lograr que se vea así (Tip: debes ajustar el HTML y el CSS)\r\n\r\n![Positioning 4][4]\r\n\r\n**Parte 6**\r\n\r\nLogra que se vea así utilizando la posición absoluta para el azul\r\n\r\n![Positioning 5][5]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/positioning.png\r\n  [2]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/positioning1.png\r\n  [3]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/positioning2.png\r\n  [4]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/positioning4.png\r\n  [5]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/positioning5.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 11, '', '', 1, NULL, NULL, NULL),
(91, 'Ejercicio: Positioning 2', '2016-07-21 21:54:26', '2016-08-23 20:55:29', 'exercise', 4, NULL, '', NULL, NULL, NULL, NULL, 20, NULL, 0, NULL, 0, 0, '', 'positioning2.zip', 'application/zip', 1856, '2016-08-23 20:55:29', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crea una carpeta que se llame **positioning2**\r\n 2. Inicializa un repositorio en dicha carpeta, y otro repositorio que se llame **positioning2** en GITHUB.\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guarda el contenido en el repositorio. (Una carpeta por paso)\r\n\r\n**Parte 1**\r\nRecrea la imagen utilizando position\r\n\r\n![Positioning 1][1]\r\n\r\n**Parte 2**\r\nRecrea la página utilizando position\r\n\r\n![Positioning 2][2]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/pos1.png\r\n  [2]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/pos2.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 11, '', '', 1, NULL, NULL, NULL),
