(125, 'El lenguaje del futuro', '2016-08-01 07:34:28', '2016-09-08 12:55:04', 'exercise', 3, NULL, '', NULL, NULL, NULL, NULL, 70, NULL, 0, NULL, 0, 0, '', 'lenguaje-futuro.zip', 'application/zip', 487818, '2016-09-08 12:55:04', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crea una carpeta que se llame **lenguaje-futuro**\r\n 2. Inicializa un repositorio en dicha carpeta, y otro repositorio que se llame **lenguaje-futuro** en GITHUB.\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guarda el contenido en el repositorio.\r\n 4. Dentro del ZIP que se encuentra en la sección de Descargas, existe una carpeta llamada **docs** que contiene el diseño final del proyecto.\r\nAbre el file index.html y recrea el website que se muestra a continuación.\r\n 6. En Internet existen muchas alternativas de grid system disponibles, has una evaluación de cual te conviene usar y desarrolla el proyecto que se ve en el pdf.\r\n\r\nSugerencia de búsqueda (Usa los siguientes keywords "best grid system for responsive design"), aquí algunos resultados interesantes\r\n\r\n[http://www.cssauthor.com/grid-systems/][1]\r\n\r\n[http://www.awwwards.com/what-are-frameworks-22-best-responsive-css-frameworks-for-web-design.html][2]\r\n\r\n[http://webdesign.tutsplus.com/articles/choosing-a-grid-system--webdesign-14490][3]\r\n\r\n\r\n![Chicama][4]\r\n\r\n\r\n  [1]: http://www.cssauthor.com/grid-systems/\r\n  [2]: http://www.awwwards.com/what-are-frameworks-22-best-responsive-css-frameworks-for-web-design.html\r\n  [3]: http://webdesign.tutsplus.com/articles/choosing-a-grid-system--webdesign-14490\r\n  [4]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/chicama.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 14, '', '', 1, '', NULL, NULL),
