(141, 'Pre work', '2016-08-08 14:10:54', '2016-08-08 17:43:58', 'prework', 1, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n \r\n  .page-container ul {\r\n  	font-size: 24px;\r\n  	color: #606060;\r\n  }\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n    font-size: 16px;\r\n  	color: #606060;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n  <div class="text-center">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/prework.jpg" height="200px"/>\r\n    <p class="line">Con el aumento del uso de internet en dispositivos móviles, miles de compañias se lanzaron a crear sus paginas .mobile o .mobi, para cubrir ese nicho. Con la interactividad de las redes sociales, estás páginas específicas para móviles se hicieron cada vez más usadas, pero se presentan problemas en experiencia de usuario, como usuarios desktop entrando a la versión móvil y viceversa. Con el tiempo surgen cada vez más dispositivos móviles, tablets y resoluciones, generando que estas páginas específicas no cubran todas las necesidades de los usuarios y fuera más complicadas de mantener. Como respuesta a estos problemas surgen una pequeña tendencia, Responsive Design, un diseño que se adapta a diferentes dispositivos y aumenta las facetas en las que el usuario puede experimentar una página web.</p>\r\n    <ul>\r\n      <li><a href="http://diseñowebresponsive.org/?utm_source=redirects&utm_medium=dise%25C3%25B1owebresponsivo.com.ar&utm_campaign=301_Redirects" target="_blank">Responsive Web Design</a></li>\r\n      <li><a href="http://librosweb.es/libro/css/capitulo_1/medios_css.html" target="_blank">Medios CSS</a></li>\r\n      <li><a href="http://www.w3schools.com/css/css3_mediaqueries.asp" target="_blank">Media Queries (Inglés)</a></li>\r\n      <li><a href="http://www.w3schools.com/css/css_rwd_intro.asp" target="_blank">RWD - Hastas media queries</a></li>\r\n    </ul>\r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, 45, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 16, '', '', 0, NULL, NULL, NULL),
(142, 'Bootstrap 3.0', '2016-08-08 15:35:02', '2016-08-08 15:35:02', 'material', 3, NULL, '', NULL, NULL, NULL, NULL, 0, NULL, 0, NULL, 0, 0, 'https://docs.google.com/presentation/d/1whg8PiQ8l6Z3TL5p-iBhBonUeb8lJRlSVOt0rXkkft8/embed?', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 16, 'slide', '', 1, NULL, NULL, NULL),
(143, 'Ejercicio Guiado: Descubriendo los breakpoints', '2016-08-08 15:42:07', '2016-08-08 15:47:05', 'exercise', 4, NULL, '', NULL, NULL, NULL, NULL, 0, NULL, 0, NULL, 0, 0, '', 'colores.zip', 'application/zip', 1850, '2016-08-08 15:42:07', '### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (Si es que ya la has creado no es necesario repetir el proceso).\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Viendo cajas\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada\r\n 4. Extrae el contenido del ZIP.\r\n\r\nSeguir las siguientes instrucciones para el ejercicio:\r\n\r\n 1. Insertar una imagen centrada y que se mantenga centrada y ajustada cuando se haga responsive\r\n 2. Utilizar los siguientes breakpoints y cambiar el color de fondo por cada rango de breakpoints\r\n\r\nBreakpoints: \r\n\r\n320px - 375px; GREEN\r\n\r\n376px - 667px; YELLOW\r\n\r\n667px - 1024px; RED\r\n\r\n1024px - 1600px; BLUE\r\n', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 16, '', '', 1, NULL, NULL, NULL),
(144, 'Ejercicio: Landing & breakpoints', '2016-08-08 15:46:51', '2016-09-13 14:58:11', 'exercise', 5, NULL, '', NULL, NULL, NULL, NULL, 0, NULL, 0, NULL, 0, 0, '', 'backyard.zip', 'application/zip', 200734, '2016-09-13 13:10:52', '\r\n### INSTRUCCIONES\r\n\r\n\r\n1.- Crea una carpeta que se llame **backyard**\r\n\r\n2.- Inicializa un repositorio en dicha carpeta, y otro repositorio que se llame **backyard** en GITHUB.\r\n\r\n3.- Descarga el zip que se encuentra en la sección de Descarga y guarda el contenido en el repositorio.\r\n\r\n4.- Dentro de la carpeta existe una carpeta llamada **docs** que contiene el diseño final del proyecto. \r\n\r\n5.- Abre el file index.html y recrea el website que se muestra a continuación.\r\n\r\n\r\nCon los archivos proporcionados crear la estructura HTML necesaria para que se vea igual que en la imagen.\r\n\r\n![landing][1]\r\n\r\nResponsive:\r\n\r\n![Responsive design][2]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/backyard.png\r\n  [2]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/backyard-responsive.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 16, '', '', 1, '', NULL, NULL),
(145, 'Ejercicio: Responsive Blog', '2016-08-08 15:57:48', '2016-08-08 18:48:06', 'exercise', 6, NULL, '', NULL, NULL, NULL, NULL, 100, NULL, 0, NULL, 0, 0, '', 'responsive-blog.zip', 'application/zip', 5217781, '2016-08-08 16:40:47', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (Si es que ya la has creado no es necesario repetir el proceso).\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Responsive Blog\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada\r\n 4. Extrae el contenido del ZIP en la misma ruta.\r\n 5. Dentro del ZIP encontrarán una imagen y un archivo index.html \r\n\r\nCon los archivos proporcionados has que se vea igual que en la imagen\r\n\r\n![Responsive Blog][1]\r\n\r\n![Responsive blog - small][2]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/responsiveblog.png\r\n  [2]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/vista-responsive.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 16, '', '', 1, NULL, NULL, NULL),
(146, 'Ejercicio: User 360', '2016-08-08 17:34:58', '2016-08-15 20:29:11', 'exercise', 7, NULL, '', NULL, NULL, NULL, NULL, 160, NULL, 0, NULL, 0, 0, '', 'Problema.zip', 'application/zip', 3298885, '2016-08-08 17:34:58', '### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (En caso ya exista no realizar este paso)\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada User-Testing.\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guardalo en la carpeta creada (User-Testing).\r\n 4. Extrae el contenido del ZIP en la misma ruta\r\n 5. Dentro del ZIP que se encuentra en la sección de Descargas, existe una carpeta docs que contiene el diseño final del proyecto\r\n\r\n![User 360][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/user360.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 16, '', '', 1, NULL, NULL, NULL),
(147, 'Ejercicio: Portafolio', '2016-08-08 19:00:49', '2016-09-13 14:57:33', 'exercise', 8, NULL, '', NULL, NULL, NULL, NULL, 0, NULL, 0, NULL, 0, 0, '', 'Problema.zip', 'application/x-zip-compressed', 862058, '2016-08-08 20:19:24', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (Si es que ya la has creado no es necesario repetir el proceso).\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Viendo cajas\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/) da (Viendo Cajas).\r\n\r\nCon los archivos proporcionados crear la estructura HTML necesaria para que se vea igual que en la imagen.\r\n\r\n![Portfolio][1]\r\n\r\n![Portfolio responsive][2]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/portfolio.png\r\n  [2]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/porftolio-responsive-opcional.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 16, '', '', 1, '', NULL, NULL),
