(153, 'Ejercicio: La República', '2016-08-16 01:31:42', '2016-09-22 13:14:37', 'exercise', 4, NULL, '', NULL, NULL, NULL, NULL, 560, NULL, 0, NULL, 0, 0, '', 'la-republica.zip', 'application/x-zip-compressed', 10417244, '2016-09-22 13:09:21', '### INSTRUCCIONES\r\nEsta actividad consiste en desarrollar el proyecto "La república" en squads para lo cual debemos cumplir con todas las ceremonias \r\nLa primera ceremonia es el poker planning, para lo cual tenemos la siguientes historias de usuarios\r\n\r\n<iframe src="https://docs.google.com/presentation/d/1IgkpoxSdmTWZJDXITTPsS5PmpZrhqEKJQ52KOaohfsw/embed?start=false&loop=false" frameborder="0" width="100%" height="600" allowfullscreen="true" mozallowfullscreen="true" webkitallowfullscreen="true"></iframe>\r\n\r\n1. Crear el board de trello donde van a trabajar\r\n2. Crear las columnas Product backlog, Sprint backlog, In progress, Done\r\n3. Usar las cartas de planning poker para ponerle un coste a cada tarea\r\n4. Una vez priorizada las tareas deben elegir que tareas irán en este sprint, para eso primero deben calcular la cantidad de puntos que como team pueden resolver para medir su velocidad inicial.\r\n5. Empezar a desarrollar las tareas y llevar el control tanto en trello como en su burndown chart (mostrar a su jedi)\r\n6. Cuando hayan terminado todos los sprints debe preparar un demo day del producto para ser revisado por el product owner y los stakeholders\r\n\r\n> Recordar hacer un repositorio colaborativo llamado **la-republica** en github', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 17, '', '', 1, '', NULL, NULL),
