(199, 'Prework Lección 24', '2016-09-12 14:04:56', '2016-09-16 15:13:33', 'prework', 0, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n    font-size: 20px;\r\n  	color: #606060;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n  <div class="text-center">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/prework.jpg" height="200px"/>\r\n    <h2>DOM</h2>\r\n    <p class="line">Revisar y <strong>*practicar*</strong> los siguientes links:</p>\r\n    <ul>\r\n      <li><a href="http://www.arkaitzgarro.com/javascript/capitulo-14.html" target="_blank">Introducción a BOM</a></li>     \r\n      <li><a href="http://aprende-web.net/progra/dom/dom_3.php" target="_blank">Introducción a DOM</a></li>\r\n    </ul>\r\n    <h3>Material de apoyo</h3>\r\n    <ul>\r\n      <li><a href="https://css-tricks.com/dom/">What is CSS?</a></li>\r\n      <li><a href="http://www.w3schools.com/jsref/tryit.asp?filename=tryjsref_win_moveto">window.moveTo()</a></li>\r\n      <li><a href="http://www.w3schools.com/jsref/tryit.asp?filename=tryjsref_win_resizeto">window.resizeTo()</a></li>\r\n      <li><a href="http://www.w3schools.com/jsref/tryit.asp?filename=tryjsref_win_moveby">window.moveBy()</a></li>\r\n      <li><a href="http://www.w3schools.com/jsref/tryit.asp?filename=tryjsref_win_resizeby">window.resizeBy()</a></li>\r\n    </ul>\r\n    <h3>Objetivos del pre-work</h3>\r\n    <p>Al finalizar el pre-work se espera tener claro las diferencias entre BOM y DOM y que objetos los componen, además de conocer métodos de dichos objetos. Finalmente, identificar las diferentes formas con las que se pueden seleccionar elementos HTML.</p>\r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, 60, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 28, '', '', 0, '', NULL, NULL),
(200, 'Ejercicio: Bunny Love', '2016-09-13 00:28:05', '2016-09-20 11:22:10', 'exercise', 9, NULL, '', NULL, NULL, NULL, NULL, 0, NULL, 0, NULL, 0, 0, '', 'bunny-love.zip', 'application/zip', 4017149, '2016-09-13 00:28:05', '\r\n\r\n1.- Crea una carpeta que se llame **bunny-love**\r\n\r\n2.- Inicializa un repositorio en dicha carpeta, y otro repositorio que se llame **bunny-love** en GITHUB.\r\n\r\n3.- Descarga el zip que se encuentra en la sección de Descarga y guarda el contenido en el repositorio.\r\n\r\n4.- Dentro de la carpeta existe una carpeta llamada **docs** que contiene el diseño final del proyecto. \r\n\r\n5.- Abre el file index.html y recrea el website que se muestra a continuación.\r\n\r\n**NOTA:** El grid a utilizar se encuentra dentro de la carpeta css y está enlazado en el index.html\r\n\r\n![coder-girl][1]\r\n\r\n\r\n  [1]: https://drive.google.com/file/d/0B8x0D9YdAac-U09GWWpiUmxmQlE/view', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 16, '', '', 1, '', NULL, NULL),
