(202, 'Ejercicio: Traducción formulario', '2016-09-14 13:52:27', '2016-09-24 15:16:54', 'exercise', 2, NULL, '', NULL, NULL, NULL, NULL, 50, NULL, 0, NULL, 0, 0, '', '_traduccion-formulario_.zip', 'application/zip', 35890, '2016-09-15 16:01:59', ' 1. Descarga los archivos en la sección de Descarga, descomprime y colócalos en tu carpeta llamada **traduccion-formulario**    \r\n 2. En consola posicionate en la carpeta **traduccion-formulario** e inicializa un repositorio en dicha carpeta\r\n 3. Crea un repositorio que se llame **traduccion-formulario** en GITHUB, haz tu primer commit y sube los archivos al repositorio.  \r\n 4. Abre el archivo **js/main.js**\r\n 5. Usando selectores, cambia los textos que aparecen por su traducción o equivalente a español, como se muestra en las imágenes:\r\n\r\n**Versión inicial**\r\n\r\n![Versión inicial][1]\r\n\r\n**Versión final**\r\n\r\n![Versión final][2]\r\n\r\n**NOTA: No se puede modificar el HTML.**\r\n**TIP**: Enlace para modificar placeholders http://stackoverflow.com/questions/13506481/change-placeholder-text\r\n\r\n\r\n  [1]: http://s12.postimg.org/lcyblqh0d/version_inicial.png\r\n  [2]: http://s12.postimg.org/ctexnz8nx/version_final.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 28, '', '', 1, '', NULL, NULL),
