(205, 'Prework Lección 26', '2016-09-14 20:17:51', '2016-09-16 22:18:11', 'prework', 0, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n    font-size: 20px;\r\n  	color: #606060;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n  <div class="text-center">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/prework.jpg" height="200px"/>\r\n	<h2>Eventos</h2>\r\n    <p class="line">Revisar y <strong>*practicar*</strong> los siguientes links:</p>\r\n    <ul>\r\n      <li><a href="https://norfipc.com/inf/javascript-lista-eventos-paginas-web.html" target="_blank">Introducción a los eventos</a></li>     \r\n      <li><a href="http://www.aprenderaprogramar.com/index.php?option=com_content&view=article&id=840:eventos-javascript-tipos-modelos-usuario-sistema-manejador-event-handler-ejemplo-confirm-cu01157e-&catid=78:tutorial-basico-programador-web-javascript-desde-&Itemid=206" target="_blank">Sobre los eventos</a></li>     \r\n      <li><a href="http://www.desarrolloweb.com/articulos/1236.php" target="_blank">Lista de eventos</a></li>\r\n    </ul>\r\n    <h3>Material de apoyo</h3>\r\n    <ul>\r\n      <li><a href="http://librosweb.es/libro/javascript/capitulo_6/modelo_basico_de_eventos_2.html">Tipos y manejadores de eventos</a></li>\r\n      <li><a href="http://librosweb.es/libro/javascript/capitulo_6/obteniendo_informacion_del_evento_objeto_event.html">Obteniendo información del evento</a></li>\r\n    </ul>\r\n    <h3>Objetivos del pre-work</h3>\r\n    <p>Al finalizar el prework, se espera identificar cómo realizar determinadas interacciones del usuario o del navegador que reaccionan a eventos usando JavaScript.</p>\r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, 60, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 30, '', '', 0, '', NULL, NULL),
(206, 'Ejercicio: Bicis Locas - Nivel 2', '2016-09-14 22:04:04', '2016-09-16 14:42:01', 'exercise', 2, NULL, '', NULL, NULL, NULL, NULL, 50, NULL, 0, NULL, 0, 0, '', 'bicis-locas-lvl2.zip', 'application/zip', 2119566, '2016-09-16 14:42:01', '## Loc@s por las bicis - Level 2\r\n\r\nPartiendo del ejercicio Loc@s por las bicis cambiaremos la forma de mostrar los errores al usuario, en vez de mostrar los errores con un alert, Si algún campo presenta error debe informarse al usuario por medio de mensaje, (idealmente un span) que se posicione en del lado derecho del input como se muestra en la imagen.\r\n\r\n![enter image description here][1]\r\n\r\n1. Descarga los archivos en la sección de Descarga, descomprime y colócalos en tu carpeta llamada **bicis-locas-lvl2**   \r\n2. En la consola posiciónate en la carpeta **bicis-locas-lvl2** e inicializa un repositorio en dicha carpeta\r\n3. Crea un repositorio que se llame **bicis-locas-lvl2** en GITHUB, haz tu primer commit y sube los archivos al repositorio. \r\n4. Abre el archivo **js/main.js** y completa la función **validateForm**, (puedes usar las validaciones anteriores) recuerda que las validaciones de los campos son las siguientes:\r\n- Todos los campos son obligatorios, excepto los dos últimos. \r\n- Los campos nombre y apellido sólo deben permitir caracteres de la A-Z\r\n- Para los campos nombre y apellido la primera letra debe ser mayúscula\r\n- Validar que el campo email tenga un formato válido. Ej: name@domain.com\r\n- El campo password debe tener al menos 6 caracteres\r\n- El campo password no puede ser igual a "password" ó "123456" ó "098754"\r\n- El valor seleccionado de bicis, debe ser una de las opciones presentadas\r\n\r\n**NOTA: ** Recomendamos que el mensaje se añada con un span ya que los estilos ya están definidos.\r\n\r\n\r\n  [1]: https://s10.postimg.org/5squk4hvt/bicis_locas_lvl2.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 29, '', '', 1, '', NULL, NULL),
(207, 'Ejercicio: Bicis Locas', '2016-09-14 22:31:04', '2016-09-15 16:17:21', 'exercise', 3, NULL, '', NULL, NULL, NULL, NULL, 50, NULL, 0, NULL, 0, 0, '', 'bicis-locas.zip', 'application/zip', 2118499, '2016-09-15 14:53:39', '\r\n## Loc@s por las bicis\r\n1. Descarga los archivos en la sección de Descarga, descomprime y colócalos en tu carpeta llamada **bicis-locas**   \r\n2. En la consola posiciónate en la carpeta **bicis-locas** e inicializa un repositorio en dicha carpeta\r\n3. Crea un repositorio que se llame **bicis-locas** en GITHUB, haz tu primer commit y sube los archivos al repositorio. \r\n4. Abre el archivo **js/main.js** y completa la función **validateForm**, se deben hacer las siguientes validaciones en los campos:\r\n- Todos los campos son obligatorios, excepto los dos últimos. \r\n- Los campos nombre y apellido sólo deben permitir caracteres de la A-Z\r\n- Para los campos nombre y apellido la primera letra debe ser mayúscula\r\n- Validar que el campo email tenga un formato válido. Ej: name@domain.com\r\n- El campo password debe tener al menos 6 caracteres\r\n- El campo password no puede ser igual a "password" ó "123456" ó "098754"\r\n- El valor seleccionado de bicis, debe ser una de las opciones presentadas\r\n5. Si algún campo presenta error debe informarse al usuario por medio de un alert.\r\n', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 28, '', '', 1, '', NULL, NULL),
