(210, 'Prework Lección 27', '2016-09-16 14:58:22', '2016-09-29 11:38:33', 'prework', 0, NULL, '<style>\r\n  .line {\r\n     font-size: 24px;\r\n  	 color: #606060;\r\n  }\r\n   .blog h1, .blog h2, .blogh3, .blog h4, .blog h5,.blog h6 {\r\n  	text-decoration:underline;\r\n  }\r\n  .blog p, .blog ul{\r\n  	margin: 0 0 20px;\r\n    text-align:left;\r\n    font-size: 20px;\r\n  	color: #606060;\r\n  }\r\n  .blog h1, .blog h2 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  pre, code {\r\n  	display:inline;\r\n  }\r\n</style>\r\n<div class="blog p-21">\r\n  <div class="text-center">\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/prework.jpg" height="200px"/>\r\n    <h2>HTML5 JavaScript APIs</h2>\r\n    <p class="line">Revisar y <strong>*practicar*</strong> los siguientes links:</p>\r\n    <ul>\r\n      <li><a href="https://www.youtube.com/watch?v=sMLOcEo-9Jk" target="_blank">Video: ¿Qué es API?</a></li>     \r\n      <li><a href="https://youtu.be/91CxoB6DHHY" target="_blank">Video: APIs en HTML5</a></li>\r\n    </ul>\r\n    <h3>Material de apoyo</h3>\r\n    <ul>\r\n      <li><a href="http://www.genbetadev.com/desarrollo-web/trabaja-offline-gracias-a-la-api-de-cache-de-html5">API Caché HTML5</a></li>\r\n    </ul>\r\n    <h3>Objetivos del pre-work</h3>\r\n    <p>Al finalizar el prework, se espera identificar qué es un API, cuáles existen dentro del estándar HTML5 y cuál es su funcionalidad.</p>\r\n  </div>\r\n</div>', NULL, NULL, NULL, NULL, 60, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 31, '', '', 0, '', NULL, ''),
