(222, 'Ejercicio: Coder Girl', '2016-09-20 11:22:35', '2016-09-20 11:33:49', 'exercise', 7, NULL, '', NULL, NULL, NULL, NULL, 160, NULL, 0, NULL, 0, 0, '', 'code-girls.zip', 'application/zip', 2926080, '2016-09-20 11:22:35', '\r\n\r\n1.- Crea una carpeta que se llame **coder-girl**\r\n\r\n2.- Inicializa un repositorio en dicha carpeta, y otro repositorio que se llame **coder-girl** en GITHUB.\r\n\r\n3.- Descarga el zip que se encuentra en la sección de Descarga y guarda el contenido en el repositorio.\r\n\r\n4.- Dentro de la carpeta existe una carpeta llamada **docs** que contiene el diseño final del proyecto. \r\n\r\n5.- Abre el file index.html y recrea el website que se muestra a continuación.\r\n\r\n6.- El sitio debe ser responsive, y debe ajustarse a distintas resoluciones.\r\n\r\n\r\n\r\n![Coder Girl][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/28220699/code.girl.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 16, '', '', 1, '', NULL, NULL),
(223, 'Ejercicio: Creamy Theme', '2016-09-20 21:21:52', '2016-09-20 21:33:26', 'exercise', 8, NULL, '', NULL, NULL, NULL, NULL, 160, NULL, 0, NULL, 0, 0, '', 'creamy-theme.zip', 'application/zip', 2294789, '2016-09-20 21:33:26', '\r\n1.- Crea una carpeta que se llame **creamy-theme**\r\n\r\n2.- Inicializa un repositorio en dicha carpeta, y otro repositorio que se llame **creamy-theme** en GITHUB.\r\n\r\n3.- Descarga el zip que se encuentra en la sección de Descarga y guarda el contenido en el repositorio.\r\n\r\n4.- Dentro de la carpeta existe una carpeta llamada **docs** que contiene el diseño final del proyecto. \r\n\r\n5.- Abre el file index.html y recrea el website que se muestra a continuación.\r\n\r\n6.- El sitio debe ser responsive, y debe ajustarse a distintas resoluciones.\r\n\r\n![Desktop][1]\r\n\r\n![Responsive][2]\r\n\r\n\r\n  [1]: http://s22.postimg.org/ysr4d84mp/screencapture_file_home_susana_Escritorio_Labora.png\r\n  [2]: http://s22.postimg.org/sgbz3e1kh/screencapture_file_home_susana_Escritorio_Labora.png', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 16, '', '', 1, '', NULL, NULL);
