(224, 'To Do App', '2016-09-28 17:45:50', '2016-09-28 17:48:58', 'exercise', 4, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, '', NULL, NULL, NULL, NULL, '### ESPECIFICACIONES\r\n\r\nEn el siguiente link encontrarás las especificaciones funcionales para realizar el ejercicio\r\n\r\nhttps://docs.google.com/document/d/1xfBQFsSMjbjbQ4h75xbbfarA8bR47G3SWnsYCefYiro/edit?usp=sharing\r\n\r\nA continuación, encontrarás una manera de cómo quedaría usando Bootstrap:\r\n\r\n![TODOAPP][1]\r\n\r\n![TODOAPP][2]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/62537196/IMAGENES%20CAPITAN%20LABORATORIA/JAVASCRIPT/TODOAPP/Todoapp1.PNG\r\n  [2]: https://dl.dropboxusercontent.com/u/62537196/IMAGENES%20CAPITAN%20LABORATORIA/JAVASCRIPT/TODOAPP/Todoapp2.PNG', '', NULL, NULL, NULL, NULL, 0, 0, 0, '', 30, '', '', 1, '', NULL, NULL),
