(1, 38, 3, '4.0', 13, 22, '2016-07-15 21:34:44', '2016-07-15 21:34:44'),
(2, 38, 4, 'Pues en todo su codigo ha mostrado que pudo hacerlo sola, claro con algunas dificultades, pues en el proceso tambien ha podido resolver algunos problemas y su ingenio hizo que crea su propio codigo, pero tambien vi que hay un proceso que seguir, y eso en el transcurso de que ella ha estado resolviendo lo pudo resolver.', 13, 22, '2016-07-15 21:34:44', '2016-07-15 21:34:44'),
