(54, 38, 5, 'Que tome más atención en los pequeños detalles, ya que su código estaba muy bien salvo la identificación de la etiqueta de encabezado h2, pues la confundió con una h3. ', 37, 54, '2016-07-15 21:34:44', '2016-07-15 21:34:44'),
