INSERT INTO `tracks` (`id`, `name`, `created_at`, `updated_at`, `description`, `syllabus`) VALUES
(1, 'Web Development Bootcamp', '2016-07-11 09:59:16', '2016-07-11 09:59:16', 'El curso web development bootcamp busca desarrollar Frontend developers capaces de insertarse en un contexto Global.. Este es el primer curso que llevan las estudiantes de laboratoria para adquirir los conceptos de desarrollo. ', 'https://drive.google.com/open?id=0B1ySBrqmZue9WU9UbllkaHFzVTg');
INSERT INTO `units` (`id`, `title`, `description`, `course_id`, `created_at`, `updated_at`, `sequence`, `points`, `duration`) VALUES
(1, 'Conceptos Básicos', 'Describe los conceptos básicos del desarrollo web e internet 101.', 1, '2016-07-09 02:13:50', '2016-07-09 02:13:50', 1, NULL, NULL),
(2, 'Principios básicos y setup', 'Describe los conceptos básicos del desarrollo web e internet 101', 4, '2016-07-11 10:08:25', '2016-07-11 10:08:25', 1, NULL, 1),
(3, 'Introducción a CSS', 'Aprende sobre los conceptos básicos de CSS cómo Floating, Positioning, Display Types y crea layouts utilizando un grid system', 4, '2016-07-11 10:09:13', '2016-07-11 10:09:13', 2, NULL, 2),
(4, 'Landing Pages', 'Ahora que ya tienes dominados los conceptos básicos con los que se hace cualquier website necesitamos practicar con proyectos reales', 4, '2016-07-11 10:09:45', '2016-07-11 10:09:45', 3, NULL, 2),
(6, 'Fundamentos de Programación', 'Aprende todo lo necesario para armar la lógica de negocios de tu web/app.', 5, '2016-08-22 14:16:29', '2016-08-22 14:16:29', 0, NULL, 2),
(7, 'DOM, Eventos y HTM5 JavaScript APIs', 'Manipulación del DOM y Eventos a través de JavaScript para agregar interactividad a los sitios web.', 5, '2016-09-12 14:04:18', '2016-09-27 14:11:43', 1, NULL, 3),
(8, 'jQuery', 'Aprende la librería de JavaScript que te permite manipular el DOM, agregar eventos y hacer peticiones asíncronas con menos líneas de código, pero también diferencia el performance comparando con VanillaJS.', 5, '2016-09-29 11:33:25', '2016-09-29 11:36:36', 2, NULL, 3);
